DELIMITER //
CREATE PROCEDURE `actualizarh`(cod INT(11),medidan VARCHAR(50),producton VARCHAR(100),partidan INT(11),existencian FLOAT(12),tipon TINYINT(4))
BEGIN
UPDATE inventario 
SET MEdida= medidan, Producto=producton , Partida=partidan , Existencia= existencian, Tipo= tipon
WHERE codigo=cod;
END//
DELIMITER ;

-- Volcando estructura para procedimiento mbv6.agregar
DELIMITER //
CREATE PROCEDURE `agregar`(nuevo FLOAT(12),producto INT(11))
BEGIN
UPDATE inventario 
SET existencia = (select SUM(existencia) FROM inventario WHERE codigo=producto)+nuevo
WHERE codigo= producto;
END//
DELIMITER ;

