INSERT INTO `conceptos` (`Id_concepto`, `nombre_co`, `funcion`, `especificacion`, `m2`) VALUES
	(1, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Pieza de 0.87 m. x 0.17 m. de diámetro color negro mate y cinta reflejante.', 1),
	(2, 'Arriate circular', 'Protege los elementos arboreos asi como al usuario de cualquier tropiezo con las raices de arboles.', 'Arriate circular de concreto armado, diámetros y alturas variables.', NULL),
	(3, 'Línea de seguridad', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', 'Porcelanico de 0.10 m. x 0.40 m. color amarillo transito o de calidad similar sobre firme de concreto, adherido con crest.', NULL),
	(4, 'Piso de recinto ', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Recinto laminado de 19 mm. color negro 0.40 m. x 0.40 m., colocado con crest piso sobre piso y junteado con boquilla negra.', 1),
	(5, 'Piso de concreto estampado', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Firme  de  concreto  con  una  resistencia  de  250  kg/cm2 estampado y terminado en color negro centro histórico con un espesor de 0.05 m y reforzados con malla electro soldada.', 1),
	(6, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Porcelanico de 0.40 m. x 0.40 m. color amarillo transito o de calidad similar sobre firme de concreto, adherido con crest.', NULL),
	(7, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Porcelanico de 0.40 m. x 0.40 m. color amarillo transito o de calidad similar sobre firme de concreto, adherido con crest.', NULL),
	(8, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro de concreto armado y tapa para mantenimiento de canalización a luminarias de poste , recubierta de piso de recinto negro antiderrapante y con jaladeras de redondo para su mantenimiento y servicio de 0.60 m. x 0.40 m.', NULL),
	(9, 'Guarnición y banquetas', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del señalamiento tipo estela. ', 'Guarnición y banquetas de concreto simple h=15 cm.', NULL),
	(10, 'Piso de recinto ', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Recinto laminado de 19 mm. color negro 0.40 m. x 0.40 m., colocado con crest piso sobre piso y junteado con boquilla negra.', 1),
	(11, 'Piso de concreto estampado', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Firme  de  concreto  con  una  resistencia  de  250  kg/cm2 estampado y terminado en color negro centro histórico con un espesor de 0.05 m y reforzados con malla electro soldada.', 1),
	(12, 'Piso de concreto.', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso de concreto simple reforzado con malla electrosoldada en piedras de medidas variables. ', 1),
	(13, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Porcelanico de 0.40 m. x 0.40 m. color amarillo transito o de calidad similar sobre firme de concreto, adherido con crest.', NULL),
	(14, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Porcelanico de 0.40 m. x 0.40 m. color amarillo transito o de calidad similar sobre firme de concreto, adherido con crest.', NULL),
	(15, 'Nariz de rampa y muro deflector', 'Elemento que forma parte de la cimentación de la rampa, su estructura sólida y con  caracteristicas de contensión, protege la circulación de los usuarios.', 'Rampa construida a base de concreto hidráulico  y acero de refuerzo con una pendiente aproximada entre el 8% y el 10%', NULL),
	(16, 'Encauzadores', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de rampa.', 'Marco conformado por tubular ced-40 de 3" Ø con medidas 1.00 m. x 3.00 m., bastidor de ángulo de 11/2" x 1/8" y lamina perforada, soldada a cuatro placas de 0.15 m. x 0.15 m. x 1/4" taqueteado a concreto con taquetes de expansión 4" x 1/2". Pintado a una mano con primario anticorrosivo y a dos con pintura de esmalte color negro.', NULL),
	(17, 'Barandal pasamanos', 'Elemento estructural metálico que sirve de guia hacia la entrada y/o salida de la estacion.', 'Tubo  de  acero  de  2”  de  diámetro  con  costura  ced.  40  terminada  con  pintura alquidalica', NULL),
	(18, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Registro de concreto armado y tapa para mantenimiento de canalización a luminarias de poste , recubierta de piso de recinto negro antiderrapante y con jaladeras de redondo para su mantenimiento y servicio de medidas 0.60 m. x 0.40 m.', NULL),
	(19, 'Luminarias', 'Fuente de iluminación para  la circulación de los usuarios que transitan en la zona de rampa para acceso o salida de la estación.', 'Luminaria tipo arbotante con iluminación directa e indirecta, forma elíptica, fabricado en fundición de aluminio moldeado, con cristal templado plano claro en marco embisagrado cut-off, reflector de aluminio anodizado multifacético con lámpara de descarga de 50 watts de aditivos metálicos para operar a 127 vca, 60 hz. de la serie oval modelo eclw, marca lumec. La curva de distribución de acuerdo a fabricante 2huw (que indica una curva asimétrica tipo II con flujo hacia abajo y hacia arriba) y  un sistema automático por medio de contactores y foteceldas', NULL),
	(20, 'Elevadores', 'Servicio para personas con discapacidad.', 'Un elevador en cada sentido de la circulación vehicular, facilitando el acceso a personas con capacidades diferentes, tiene una capacidad de carga de 350 kg. Aproximadamente 3 personas, velocidad de 0.15 m. /seg., Alimentación eléctrica: de 220 V 60 Hz, cuenta con batería de respaldo para que la cabina vuelva hacia el piso inferior, fijación sobre piso de concreto armado según especificaciones y lateralmente sobre loza de desembarque del puente, considerando un foso de 100 mm. Dos puertas panorámicas abatibles de 900 mm. x 2000 mm. en acero zincado con pintura electrostática en color S.M.A., botoneras de llamado, herméticas con sistema Braille, paneles para estructura en combinación de tres lados en cristal templado y un lado policarbonato celular (lado del mástil), según posición del mástil. La cabina cuenta con las siguientes características dimensiones interiores de 1400mm x 1400 mm x H 2100 mm. acabado en acero inoxidable tipo lino rígido, antiralladuras, S.M.A. una pared panorámica (lado B) de cristal templado con pasamanos tubular en acero inoxidable y contratecho de rejilla plástica con luz neón. S.M.A., piso antiderrapante en goma imitación granito y color S.M.A., dispositivo de seguridad por medio de fotoceldas en cada acceso, timbre de alarma electrónico, botonera de cabina antivandálicas con sistema Braille.', NULL),
	(21, 'Escaleras eléctricas', 'Servicio para personas con discapacidad.', '', NULL),
	(22, 'Piso de recinto ', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Recinto laminado de 19 mm. color negro 0.40 m. x 0.40 m., colocado con crest piso sobre piso y junteado con boquilla negra.', 1),
	(23, 'Piso de concreto estampado', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Firme  de  concreto  con  una  resistencia  de  250  kg/cm2 estampado y terminado en color negro centro histórico con un espesor de 0.05 m y reforzados con malla electro soldada.', 1),
	(24, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Porcelanico de 0.40 m. x 0.40 m. sobre firme de concreto, adherido con crest.', NULL),
	(25, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Porcelanico de 0.40 m. x 0.40 m. sobre firme de concreto, adherido con crest.', NULL),
	(26, 'Línea de seguridad', 'Pieza de señalizacion visual en piso que delimita el area segura para el usario en las puertas de asecnso y descenso.', 'Porcelanico de 0.10 m. x 0.40 m. sobre firme de concreto, adherido con crest.', NULL),
	(27, 'Muro deflector.', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', '', NULL),
	(28, 'Nariz de andén.', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', 'Nariz de anden de concreto armado 250 kg/cm2 de espesor variable. ', NULL),
	(29, 'Letrero luminoso de nombre de estación.', '', 'Letrero de acrílico con iluminación indirecta de medidas 0.51 m. x 3.00m.', NULL),
	(30, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajoanden para personal de mantenimiento.', 'Tapa registro a bajo andén con jaladeras de redondo para su mantenimiento recubierta de piso de recinto negro y placa inferior; compuesta por dos tapas independientes de 0.45mx0.90m. Estructura recubierta de primer base gris.', NULL),
	(31, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Puertas metálicas a dos hojas a base de tubo de acero galvanizado de 2” ced. 40, primeada y pintada  con  pintura  alquidalica,  forrada  con  lamina  de  acero  galvanizado  acabado  aparente  y lamina perforada cal. 14. ', NULL),
	(32, 'Puertas de servicio', 'Puertas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Primer cortina de 4.53 m. de ancho por 2.50 m. de alto mas rollo, segunda cortina de 2.64 m. de ancho por 2.50 m. de alto mas rollo y tercer cortina de 2.54 m. de ancho por 2.50 m. de alto más rollo, (por sentido de circulación); con función de cadena, ubicadas en piernas de estructura y gabinete de rollo en caja de lamina color negro mate de 0.56 m. x 0.57 m. x largo respectivamente.', NULL),
	(33, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'A base  de vigas I.P.R. de 10" x 39 lb/ft soldada a placa base, que estará fija a la losa del andén a 5 cms. del nivel de piso terminado cumpliendo la función de columnas desplantadas a cada 6.00 m a lo largo de la estación soportando la estructura de la cubierta.', NULL),
	(34, 'Mampara metálica', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Mampara a base de marco de solera de 4" x 3/4" y soleras horizontales de 2" x 5/8"@ 20 cm. y poste de perfil de 6"x10.50 lb/ft. Material  anticorrosivo de croma cote de zinc y pintura alquidalica epóxico  aplicada hasta cubrir perfectamente la superficie.', NULL),
	(35, 'Mampara de cristal', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Los cerramientos transparentes están compuestos por paneles de vidrio templado con un grosor de 10 mm. Se sustentan en los 2 ejes cilíndricos de acero de la estructura a través de piezas especiales que aseguran su sujeción, el vidrio se presenta con un serigrafiado del anagrama de Metrobús.', NULL),
	(36, 'Mampara publicitaria', 'Elemento de cerramiento ciego perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Estructura en perfilería de acero rematado con un aplacado de granito gris claro de 1.5 cm. de espesor con acabado pulido en la parte inferior y superior. El aplacado se ancla a una estructura auxiliar de perfilería de acero mediante grapas metálicas. En la parte exterior se coloca un espacio publicitario de 8 m2 de superficie visible. En la parte interior se pueden albergar diversos elementos de carácter institucional y publicitarios: Mupis, planímetros, maquinas expendedoras, pantallas de información, etc. En el interior de las estaciones se instalarán soportes publicitarios de 2 m2 de superficie publicitario (MUPIS) rematado por la cara exterior por un cristal templado con espesor de 6 mm. y serigrafía color negro pegado al marco con silicona estructural. Los Mupis de 8 m2 se ubicarán en los laterales de la parte exterior del cerramiento y un Mupi de 4 m2 se colocará en la parte exterior de la cabecera de la estación.', NULL),
	(37, 'Tubo cubre mamparas', 'Elemento al interior de la estación que sirve como proteccion a mamparas de cristal.', 'Tubular de  3" de diámetro cubre mamparas ubicado entre columnas y soldado a placa de acero inoxidable y tornillería a columnas.', NULL),
	(38, 'Bancas metálicas', 'Elemento en estación que sirve para el usuario mientras espera abordar una unidad.', 'Chapa plegada de acero inoxidable de AISI 304-L de 2 mm. satinado. Numero variado dependiendo de estación. ', NULL),
	(39, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encausador de acero , cámaras de video vigilancia y pantallas informativas.', NULL),
	(40, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'Tactograma de acero inoxidable con placas de 0.20 m. x 0.20 m. (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable y placas tope de acrílico de 0.35x0.30m fijadas con remaches a estructura; botonera de encendido de torreta fijada a pierna de 1er puerta de servicio; botonera de apagado exterior con tubo de 2" por 1.18 m y caja (para operador); torreta giratoria con luz indicadora de acceso fijada a estructura; botonera de audio de programa de corridas (1 pza. por sentido general).', NULL),
	(41, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lamina de 0.36x0.21x0.71 m. fijado a estructura de estación con pintura roja y cristal transparente de 0.21x0.57 m. y chapa de servicio; extintor tipo ABC de 4.5 Kg. De capacidad ubicado dentro de gabinete. Se extinguidores PQS (polvo químico seco) que consta de un cilindro de 4.5 Kg. ', NULL),
	(42, 'Techumbre', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Empotrada en las columnas de ipr de 10” x 30” formada por medio de tubo de acero galvanizado de 4” ced. 40 y cps de 6” x 10.50, contando con tensores en el lado corto del volado de tubo de acero de 2” y un tensor por el lado largo de tubo de 3” ced. 40 y la cubierta habilitada en lámina de policarbonato celular tipo multicell con un espesor de 16 mm', NULL),
	(43, 'Señaletica interior y exterior', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Interiores: Ruta de evacuación (0.40 m. x 0.20 m.), informativo tipo bandera (0.40 m. x 0.60 m.), ruta de evacuación tipo cartel (0.40 m. x 0.30 m.), nombre de estación tipo cartel (0.22 m. x 1.44 m.), restrictivo tipo puente (0.50 m. x 2.30 m.), informativo tipo puente en puertas 1 y 2 (0.42 m. x 4.50 m.), informativo tipo puente en puertas 3 y 4 (0.42 m. x 2.60 m.), informativo tipo puente en estación (0.50 m. x 2.30 m.), restrictivo tipo cartel en estaciones tramo sur (0.50 m. x 0.50 m.), solo salida tipo cartel (0.50 m. x 1.00 m.), plano de sistema (0.70 m. x 1.15 m.), plano de barrio (0.70 m. x 1.15 m.), personas exentas de pago (0.60 m. x 0.40 m.). ', NULL),
	(44, 'Contactos de acceso y andén', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', '', NULL),
	(45, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Caja metálica con puerta de 0.20 m. x 0.30 m. x 0.15 m. tipo Himel.', NULL),
	(46, 'Luminarias ', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona central a lo largo de la plataforma  (lecho bajo de la cubierta).', 'Luminaria ACCIAIO ECO LED Mod. ACE4HT50WWT40UNV de 50 watts de lámina de acero galvanizado resistente a la corrosión, pintado electrostáticamente en color gris RAL7040. Cabeceras de policarbonato / Tereftalato de poli butileno (PBT+PC), desmontables para acceso a mantenimiento. Brackets de montaje hechos de acero inoxidable. Difusor, junta y cánope están unidos en una sola pieza. Módulo porta balastro/lámpara: desmontable lateralmente, garantizando el sellado y permitiendo una rápida desconexión y mantenimiento', NULL),
	(47, 'Cortinas metálicas', 'Cortinas metalicas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Cortinas enrollables de acero galvanizado, 4 para acceso al autobús y otra cortina para acceso principal a la estación. Con una estructura totalmente de acero galvanizado con una altura de 2700 mm. y automáticas mediante motor monofásico. La apertura se realiza por mando emisor a distancia o por contactor de llave, es decir automática y manualmente. Comportamiento frente al fuego: clase de material A2 (no combustible) peso de la persiana aproximadamente 15 Kg./m2.', NULL),
	(48, 'Piso de recinto ', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Recinto laminado de 19 mm. color negro 0.40 m. x 0.40 m., colocado con crest piso sobre piso y junteado con boquilla negra.', 1),
	(49, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la plataforma de la estación hasta el sanitario en el módulo de servicios.', 'Porcelanico de 0.40 m. x 0.40 m. sobre firme de concreto, adherido con crest.', NULL),
	(50, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de botón circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Porcelanico de 0.40 m. x 0.40 m. sobre firme de concreto, adherido con crest.', NULL),
	(51, 'Muro deflector.', 'Elemento que forma parte de la cimentación del módulo de servicios .Su estructura sólida y con características de contención, protege la circulación y estancia de los usuarios. Este muro delimita y protege también el espacio en el bajo andén.', 'Nariz de anden de concreto armado 250 kg/cm2 de espesor variable. ', NULL),
	(52, 'Puertas de cuartos en modulo de servicio', 'Puertas para cierre de los cuartos de servicio y sanitarios en el área de módulos de servicio.', 'Puertas de servicio en sanitario mixto, cuarto de servicio, rack de computo y cuarto eléctrico de metal con chapa, jaladera y pasador de 0.90 m. x 2.10 m. con pintura negro mate; y puerta de sanitario familiar de 1.20 m. x 2.10 m. con antepecho de lamina de 1.20 m. x 0.50 m. con chapa, jaladera y pasador con pintura negro mate.', NULL),
	(53, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las instalaciones hidrosanitarias y eléctricas de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Tapa registro a bajo andén con jaladeras de redondo para su mantenimiento recubierta de piso de recinto negro y placa inferior; compuesta por dos tapas independientes de 0.45mx0.90m. Estructura recubierta de primer base gris.', NULL),
	(54, 'Accesorios y muebles sanitarios ', 'Tienen la finalidad de dar servicio de manera accesible para los servicios sanitarios. Cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', 'W.C., combo W.C. - lavabo, mingitorio, (soporteria para discapacitados), jabonera, perchero, papelera portarollos, espejo, lavabo, tarja, de acero inoxidable y cambiador.', NULL),
	(55, 'Contactos ', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(56, 'Apagadores', 'Dispositivos de encendido y apagado de las luminarias en los cuartos y sanitarios del módulo de servicio.', 'Apagador doble estándar a 120 v de voltaje y 15 amperes de corriente alterna con tapa para caja chalupa con salida.', NULL),
	(57, 'Luminarias en módulo', 'Fuente de iluminación para los usuarios en los cuartos y sanitarios del módulo de servicios.', '', NULL),
	(58, 'Muros en modulo', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Muro de concreto armado acabado aparente con cimbra de madera rayada a cada 20 cm. por ambas caras, espesor del muro h=20 cm. Que sirven para ubicar maquinas expendedoras y proteger equipo de recaudo.', NULL),
	(59, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m. x 0.10 m., vialeta metálica de 0.10 m. x 0.11 m., vialeta plástica de 0.10 m. x 0.11 m., súper vialeta de 0.20 m. x 0.045 m., vialeton de 0.25 m. x 0.05 m., galibo de 1.80 m. x 0.06 m., botón metálico de 0.10 m. de diámetro, botón metálico de 0.13 m. de diámetro, boyas metálica de 0.20 m. de diámetro.', NULL),
	(60, 'Elemento de contención peatonal', 'Panel electrosoldado de euroreja galvanizado de alambre cal. 9 de 2.00 mts. de alto x 2.00 mts. de largo con pintura en polvo termo endurecida color negro', 'Elemento íntegro y continuidad hasta el cruce seguro.', NULL),
	(61, 'Carpeta de rodamiento', 'Pavimento para rodamiento de los autobuses de Metrobús.', 'Carpeta de concreto hidráulico de 30 cm. De espesor, con concreto premezclado modulo de ruptura MR-45 = 45 Kg/cm², tendido con regla vibratoria, con barras de amarre con varillas corrugadas y pasajuntas de redondo liso de 11/4" de 45 cm. De longitud a cada 30 cm. ambas. En zona de estaciones. Incluye: cimbra, juntas de contracción y de construcción, mano de obra, equipo, herramienta, limpieza, acarreos, descargas dentro y fuera de la obra a tiro autorizado por la D.G.P.E. según proyecto, especificaciones y/o indicaciones de la D.G.P.E. y todo lo necesario para su correcta ejecución, los trabajos deberán ser considerados tanto diurnos como nocturnos sin cargo adicional, opera la D.G.P.E. P.U.O.T. ', 1),
	(62, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Balizamiento con pintura termoplástica para señalización vial.', NULL),
	(63, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos. ', NULL),
	(64, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Elemento sólido de polietileno reciclado en forma piramidal de una sola pieza, que incluya en la parte interior un alma de acero, con reflejante en grado diamante, medidas de ancho: 0.365 m x altura 0.45 m', NULL),
	(65, 'Línea de seguridad', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', 'Cadena de remate de piso exterior, de 30 cm de peralte y hasta 34 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. Acabado martelinado fino por medios manuales.', NULL),
	(66, 'Piso de recinto negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 20x20x2.5 cms de espesor, dejando juntas de 5 mm aprox. Con una absorción máxima del 8%, color recinto negro o equivalente en calidad, textura y color colocado con adhesivo crest blanco o equivalente en calidad sin agregar agua, junteado con boquicrest ultra color negro o equivalente en calidad.', 1),
	(67, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Guía táctil lineal de 3 canales de 0.20 m x 0.40 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(68, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 0.20 m x 0.20 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. Colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(69, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro eléctrico de 60.0 x 80.0 cm. de ladrillo de lama de 5.5 x 11.0 x 22.0 cm, a soga, asentado y aplanado con mortero cemento - arena 1:4, con cama de grava de 5.0 cm de espeso, tapa de registro de placa de acero de 1/4" con medidas 0.55m x 0.75m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.20m x 2.5 cms de espesor', NULL),
	(70, 'Estela informativa central', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30m x0.65m x1.00m recubierta con pintura, y saliente de anclas, placa base de 0.30m x 0.60m a la estructura de PTR de 4" x 4" x 2.00m y estela de prisma cuadrangular de 0.50 m por lado x 2.14 m de altura recubierta con pintura y señalética de "nombre de estación en cada una de sus caras.', NULL),
	(71, 'Banqueta de media luna', 'Base sobre la cual se desplanta el señalamiento tipo estela. ', 'Firme de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con malla electrosoldada 6x6 10/10, preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado.', NULL),
	(72, 'Guarniciones', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del señalamiento tipo estela. ', 'Elemento de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con varilla 3/8", preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado, con acabado en pintura esmalte amarillo tránsito.', NULL),
	(73, 'Piso de recinto negro .', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 20x20x2.5 cms de espesor, dejando juntas de 5 mm aprox. Con una absorción máxima del 8%, color recinto negro o equivalente en calidad, textura y color colocado con adhesivo crest blanco o equivalente en calidad sin agregar agua, junteado con boquicrest ultra color negro o equivalente en calidad.', 1),
	(74, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Guía táctil lineal de 3 canales de 0.20 m x 0.60 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(75, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 0.20 m x 0.20 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. Colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(76, 'Muro deflector', 'Elemento que forma parte de la cimentación de la rampa, su estructura sólida y con  caracteristicas de contensión, protege la circulación de los usuarios.', 'Muro de concreto armado de 30 cm de espesor con acabado aparente pulido y recubierto con pintura gris, concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. ', NULL),
	(77, 'Encauzadores', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de rampa.', 'Marco conformado de ancho "variable" x 1.10m de alto de perfil PTR de 4" x 2" y tambor de rejilla tipo Irving de 1" soldada a placa en piso en los laterales, recubierta con pintura negro mate y pasamanos de perfil tubular de 1 1/2" de diámetro.', NULL),
	(78, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Tapa de registro de placa de acero de 1/4" con medidas 0.45m x 0.60m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.20m x 2.5 cms de espesor', NULL),
	(79, 'Luminaria en poste', 'Fuente de iluminación para  la circulación de los usuarios que transitan en la zona de rampa para acceso o salida de la estación.', 'Columna de iluminación exterior tipo kuma f08 o similar, con altura de 4.00 mts, con difusor transparente alta resistencia a impactos. diámetro de 22 cms, base de placa de 40 X 40 X 1/4" de espesor, con 4 barrenos para fijación.', NULL),
	(80, 'Piso de recinto negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 20x20x2.5 cms de espesor, dejando juntas de 5 mm aprox. Con una absorción máxima del 8%, color recinto negro o equivalente en calidad, textura y color colocado con adhesivo crest blanco o equivalente en calidad sin agregar agua, junteado con boquicrest ultra color negro o equivalente en calidad.', 1),
	(81, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Guía táctil lineal de 3 canales de 0.20 m x 0.60 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(82, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 0.20 m x 0.20 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. Colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(83, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(84, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(85, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajoanden para personal de mantenimiento.', 'Tapa de registro de placa de acero de 1/4" con medidas 0.80m x 0.80m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.20m x 2.5 cms de espesor', NULL),
	(86, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Portón de acceso compuesto por dos hojas abatibles con 2 topes limite, un cerrojo, 2 pasadores , 4 casquillos en piso y 4 tejuelos, mediante rejilla Irving is-05 de 1" x 1/8" y placa de acero inoxidable con logo de la Ciudad de México', NULL),
	(87, 'Puertas de servicio', 'Puertas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Primer puerta doble abatible de 4.50 m de ancho por 2.00 m de alto, segunda  puerta doble abatible de 3.00 m de ancho por 2.00 m de alto y tercer  puerta doble abatible de 2.54 m de ancho por 2.50 m de alto, (por sentido de circulación); mediante con marco a base de placa de 3/16" de espesor y tambor a base de rejilla Irving is-05 de 1" x 1/8"', NULL),
	(88, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columna circular de acero a 53 tipo s (b) sin costura de 14.1 cms de diámetro exterior y 3.10 m de altura ubicadas por ejes de estación con viga I transversal superior de 15.10 m x 0.10 m, perfil especial de lámina de acero doblada no. 1 al no. 9 con puntura negro mate.', NULL),
	(89, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encauzador de acero , cámaras de videovigilancia y pantallas informativas.', NULL),
	(90, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'Tactograma de acero inoxidable con placas de 0.22 x 0.15 m (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable; botonera de encendido de torreta fijada a columna derecha de 1er puerta de servicio; botonera de apagado exterior con tubo de 2" por 1.18 m y caja (para operador); torreta giratoria con luz indicadora de acceso fijada a estructura; botonera de audio de programa de corridas (1 pza. por sentido general), placa metálica  en piso para discapacitados de 0.20 m x 0.20 m.', NULL),
	(91, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lámina de 0.36 x 0.21 x 0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21 x 0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. de capacidad ubicado dentro de gabinete.', NULL),
	(92, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Estructura a base de perfiles de acero a 572 grado 50 con pintura de esmalte intumescente epóxido, diluida con solvente especial sgf 036, con un espesor de 16 +- 2 milésimas de pulgada para garantizar protección contra fuego por 3 horas, color aluminio natural según muestra aprobada por el proyectista y cubierta con sistema imsa marca multypanel, línea arquipanel o equivalente en calidad, en módulos de 60 cms de ancho, compuestos por 2 láminas de acero liso galvanizado capa g 90, calibre 22 al exterior y 26 al interior, prepintadas con acabado kynar color maki silver al exterior y acabado poliéster estándar color arena embozado al interior, unidas por un núcleo de espuma rígida de poliuretano de 1 1/2" de espesor formando un elemento tipo sándwich con diseño de junta tipo hembra y macho sellada perimetralmente con silicón marca dow corning o equivalente en calidad color negro. Los módulos de 60 cms de ancho, serán de longitud variable, formando una sola pieza que incluye dobleces en la cumbrera, frentes y puntas, en las cuales deberá doblarse de la misma pieza de arquipanel según el plano de detalles.', NULL),
	(93, 'Mampara metálica', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Marco y soportes a base de solera de acero de 6.35 x 0.48 cm rejilla Irving o de la misma calidad y especificación tipo is-05 1/8" x 1" de ancho variable y altura de 2.10 m ', NULL),
	(94, 'Mampara bastidor', 'Elemento de cerramiento ciego perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Solera de acero de  1/4" soporte de equipo respaldo para solera a base de ptr de 2" placa de polisocianurato en cada espacio de 2.65 m de ancho y alto de 2.10 m.', NULL),
	(95, 'Mamparas de cristal', 'Elemento de cerramiento transparente perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Cistal templado de 6.0+6.0 mm con unión de PBV transparente con cenefa de MB o Nombre de estación y un alto de 2.00 m y ancho 2.67 m.', NULL),
	(96, 'Señalética interior y exterior', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Ruta de evacuación de 0.40 m X 0.20 m, letrero luminoso de nombre de estación a base de acrílico de 2.70 X 0.40 X 0.20 m a una cara, "nombre de estación" de 1.20 X 0.30 m ,calcomanía en poste  "acceso a discapacitados" de 0.12 X 0.10 m, restrictivo "recomendaciones" 0.65 X0.15 m y 0.90 X 0.15 m y señalamiento tipo puente de 2.70 X0.40 X 0.20 m, señalamiento restrictivo de galibo en lámina galvanizada calibre 16, con dimensiones de 0.60 X 0.60 m indicando la leyenda de "3.90 m", señalamiento restrictivo en lámina galvanizada calibre 16 con dimensiones de 1.00 X 0.20 m con esmalte tipo reflejante con franjas rojas y blancas inclinadas a 45 grados.', NULL),
	(97, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(98, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Gabinete metálico de 0.25 m x 0.20 m x 0.15 m, tipo himel', NULL),
	(99, 'Luminarias en puerta de servicio (circulares)', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona de puertas para ascenso y descenso del autobús  (lecho bajo de la cubierta).', 'Unidad de iluminación fluorescente de empotrar tipo Down Light, catálogo No. AFI-26DTT8ART73, autobalastrada diseñada para operar una lámpara ahorradora compacta de 26 watts, A 1F, 2H, 127, VCA, 60 Hz.', NULL),
	(100, 'Luminarias centrales', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona central a lo largo de la plataforma  (lecho bajo de la cubierta).', 'Unidad de iluminación fluorescente de sobreponer tipo cubic, catálogo No. C868-232-9R, con balastro electrónico diseñado para operar dos lámparas ahorradoras de 32 watts, A 1F, 2H, 127, VCA, 60 Hz.', NULL),
	(101, 'Sistema de Tierras y Puntas Pararayos Faraday', 'Elemento eléctrico retener un sistema de descarga en un tormenta electrica y proteger a los equipos de mantenimiento y de comunicación al interior de la estación.', 'Cable desnudo  de 8 hilosque pasa atravez de la estructura desde el bajo anden hasta la techumbre .  Punta faraday macisa de acero ioxidable pulida con cuerda en un extremo marca ranicin , sujetador de laton atornillado a estructura.', NULL),
	(102, 'Piso de recinto negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 20x20x2.5 cms de espesor, dejando juntas de 5 mm aprox. Con una absorción máxima del 8%, color recinto negro o equivalente en calidad, textura y color colocado con adhesivo crest blanco o equivalente en calidad sin agregar agua, junteado con boquicrest ultra color negro o equivalente en calidad.', 1),
	(103, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Guía táctil lineal de 3 canales de 0.20 m x 0.60 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(104, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 0.20 m x 0.20 m de concreto polimérico color mostaza o equivalente en calidad, textura y color, dejando juntas de 3 mm aprox. Colocado con adhesivo crest blanco o equivalente en calidad, mezclado con adicrest mp-plus o equivalente en calidad, sin agregar agua, junteado con boquicrest ultra color beige o equivalente en calidad.', NULL),
	(105, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(106, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(107, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajoanden para personal de mantenimiento.', 'Tapa de registro de placa de acero de 1/4" con medidas 0.80m x 0.80m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.20m x 2.5 cms de espesor', NULL),
	(108, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Portón de acceso compuesto por dos hojas abatibles con 2 topes limite, un cerrojo, 2 pasadores , 4 casquillos en piso y 4 tejuelos, mediante rejilla Irving is-05 de 1" x 1/8" y placa de acero inoxidable con logo de la Ciudad de México', NULL),
	(109, 'Puertas de servicio', 'Puertas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Primer puerta doble abatible de 4.50 m de ancho por 2.00 m de alto, segunda  puerta doble abatible de 3.00 m de ancho por 2.00 m de alto y tercer  puerta doble abatible de 2.54 m de ancho por 2.50 m de alto, (por sentido de circulación); mediante con marco a base de placa de 3/16" de espesor y tambor a base de rejilla Irving is-05 de 1" x 1/8"', NULL),
	(110, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columna circular de acero a 53 tipo s (b) sin costura de 14.1 cms de diámetro exterior y 3.10 m de altura ubicadas por ejes de estación con viga I transversal superior de 15.10 m x 0.10 m, perfil especial de lámina de acero doblada no. 1 al no. 9 con puntura negro mate.', NULL),
	(111, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encauzador de acero , cámaras de videovigilancia y pantallas informativas.', NULL),
	(112, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'Tactograma de acero inoxidable con placas de 0.22 x 0.15 m (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable; botonera de encendido de torreta fijada a columna derecha de 1er puerta de servicio; botonera de apagado exterior con tubo de 2" por 1.18 m y caja (para operador); torreta giratoria con luz indicadora de acceso fijada a estructura; botonera de audio de programa de corridas (1 pza. por sentido general), placa metálica  en piso para discapacitados de 0.20 m x 0.20 m.', NULL),
	(113, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lámina de 0.36 x 0.21 x 0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21 x 0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. de capacidad ubicado dentro de gabinete.', NULL),
	(114, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Estructura a base de perfiles de acero a 572 grado 50 con pintura de esmalte intumescente epóxido, diluida con solvente especial sgf 036, con un espesor de 16 +- 2 milésimas de pulgada para garantizar protección contra fuego por 3 horas, color aluminio natural según muestra aprobada por el proyectista y cubierta con sistema imsa marca multypanel, línea arquipanel o equivalente en calidad, en módulos de 60 cms de ancho, compuestos por 2 láminas de acero liso galvanizado capa g 90, calibre 22 al exterior y 26 al interior, prepintadas con acabado kynar color maki silver al exterior y acabado poliéster estándar color arena embozado al interior, unidas por un núcleo de espuma rígida de poliuretano de 1 1/2" de espesor formando un elemento tipo sándwich con diseño de junta tipo hembra y macho sellada perimetralmente con silicón marca dow corning o equivalente en calidad color negro. Los módulos de 60 cms de ancho, serán de longitud variable, formando una sola pieza que incluye dobleces en la cumbrera, frentes y puntas, en las cuales deberá doblarse de la misma pieza de arquipanel según el plano de detalles.', NULL),
	(115, 'Mampara metálica', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Marco y soportes a base de solera de acero de 6.35 x 0.48 cm rejilla Irving o de la misma calidad y especificación tipo is-05 1/8" x 1" de ancho variable y altura de 2.10 m ', NULL),
	(116, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m x 0.10 m, vialeta metálica de 0.10 m x 0.11 m, vialeta plástica de 0.10 m x 0.11 m, súper vialeta de 0.20 m x 0.045 m, vialeton de 0.25 m x 0.05 m, galibo de 1.80 m x 0.06 m, botón metálico de 0.10 m de diámetro, botón metálico de 0.13 m de diámetro, boyas metálica de 0.20 m de diámetro, ', NULL),
	(117, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo Metrobús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(118, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(119, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(120, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(121, 'Cerca peatonal', 'Dispositivo físico para canalizar el tránsito peatonal.', 'Panel electrosoldado de euroreja galvanizado de alambre cal. 9 de 2.00 mts. de alto x 2.00 mts. de largo con pintura en polvo termo endurecida color verde', NULL),
	(122, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Elemento sólido de polietileno reciclado en forma piramidal de una sola pieza, que incluya en la parte interior un alma de acero, con reflejante en grado diamante, medidas de ancho: 0.365 m x altura 0.45 m', NULL),
	(123, 'Piso de concreto', 'Piso de concreto hidraulico para zona de espera en  cruce seguro de los usarios, continuando con el balizamiento de cruce peatonal.', 'Losa de concreto hidráulico de 30 cms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 cms de espesor, una capa sub- base  con relleno fluido de 20 cms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 cms de longitud @ 30 cms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 cms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', NULL),
	(124, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro eléctrico de 60.0 x 80.0 cm. de ladrillo de lama de 5.5 x 11.0 x 22.0 cm, a soga, asentado y aplanado con mortero cemento - arena 1:4, con cama de grava de 5.0 cm de espeso, tapa de registro de placa de acero de 1/4" con medidas 0.55m x 0.75m, con metal desplegado c13-26 natural, punteado a la placa.', NULL),
	(125, 'Estela informativa central', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30m x 0.30. x 0.80m recubierta con pintura negro mate, y saliente de anclas; placa de ½” y base  de PTR De 5" X 5" X 1.54m y estela de prisma triangular de 0.50m por lado x 2.00m de altura recubierta con pintura negro mate y señalética de "nombre de estación en cada una de sus caras; copete triangular de 0.85m por lado x0.15m de espesor y luminarias en cada uno de sus lados.', NULL),
	(126, 'Estela informativa lateral', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30m x 0.30. x 0.80m recubierta con pintura negro mate, y saliente de anclas; placa de ½” y base  de PTR De 5" X 5" X 1.54m y estela de prisma triangular de 0.50m por lado x 2.00m de altura recubierta con pintura negro mate y señalética de "nombre de estación en cada una de sus caras.', NULL),
	(127, 'Banqueta de media luna', 'Base sobre la cual se desplanta el señalamiento tipo estela. ', 'Banqueta a base de concreto f´c= 150 Kg/cm2 en forma de media luna de 2.70m de largo y un radio de 1.15m y un espesor de 0.20m, armada con malla electrosoldada.', NULL),
	(128, 'Guarniciones', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del señalamiento tipo estela. ', 'Elemento de concreto fc= 150 kg/cm2 hecho en obra de 0.20m de espesor, armado con varilla 3/8", preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado, con acabado en pintura esmalte amarillo tránsito.', NULL),
	(129, 'Piso de recinto negro .', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piezas de recinto negro laminado  antiderrapante de 0.40m x 0.40m x 5cm colocadas a losa de concreto armado con mortero cemento-arena proporción 1:3 y adehcon, con juntas promedio de 2 mm color negro juntex.', 1),
	(130, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Piezas de 2 canales de policoncreto con dimensiones de 0.20m x 0.40 m, con espesor de 2.2 cms y una absorcion de humedad menor al 0.9%,y resistencia de 900 a 1528 kg/cm^2, color amarillo transito; colocada con pegamento epoxico s.m.a. y solera de 1 1/2"x 3/8" colocadas a canto fijadas a la plataforma por varillas de 3/8" y taquetes químicos epoxicos.', NULL),
	(131, 'Nariz de rampa ', 'Borde estruc tural sobre los muros deflectores de la rampa, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', 'Losa de concreto armado de 20.85m x 0.30m y 10cm de espesor, para remate de anden  con acabado pulido y una pendiente del 6.5%, concreto de alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2   y recubierto con  pintura gris por la parte frontal e inferior, colado integral junto con muro deflector.', NULL),
	(132, 'Muro deflector', 'Elemento que forma parte de la cimentación de la rampa, su estructura sólida y con  caracteristicas de contensión, protege la circulación de los usuarios.', 'Muro de concreto armado de 30cm de espesor con acabado aparente pulido y recubierto de pintura gris, concreto alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2,  colado integral junto con nariz de anden.  ', NULL),
	(133, 'Encauzadores', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de rampa.', 'Marco conformado por viga IPR de 6"x4"x1.20m soldada a placa en piso en los laterales, y remate de solera superior de 4" x largo variable x 3/4" de espesar; y 12 Tubulares de 3/4" de diámetro distribuidos, con un largo entre 0.92 a 1.34 m, recubierta con pintura negro mate, con  pasamanos doble  tubular de  de 1 ½” de acero inoxidable en alturas de 0.75 y 0.90 mts respectivamente, a base de perfiles "oc", fijadas por medio de soldadura a perfiles IPR del encauzador.', NULL),
	(134, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Registros con tapa de concreto armado con marco de ángulo de   2” x ¼”de y contramarcos de ángulo de 2 ½ ” x 3/8”de acero inoxidable para mantenimiento de canalización a luminarias de poste de 0.59m x 0.69m y un espesor de 10cm, recubierta de piso de recinto negro laminado antiderrapante de 0.40 x 0.40m y con jaladeras de redondo.', NULL),
	(135, 'Luminaria en poste', 'Fuente de iluminación para  la circulación de los usuarios que transitan en la zona de rampa para acceso o salida de la estación.', 'Lámparas con estructura tipo poste fijadas mediante pernos a piso y placa base de 0.28mx0.28m, con fotocelda de encendido automático estructura tipo cilíndrica tubular de 3 1/2" recubierta con pintura negro mate.', NULL),
	(136, 'Placa en junta de plataforma y rampa.', 'Material metálico en piso para la transición de junta constructiva de rampa y plataforma sobre el cual transitan los usuarios.', 'Placa de acero al carbón doble de 0.20m x 1.20 con espesor de ½” fijada a piso para la transición entre rampa y plataforma.', 0),
	(137, 'Piso de recinto negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piezas de recinto negro laminado  antiderrapante de 0.40m x 0.40m x 5cm colocadas a losa de concreto armado con mortero cemento-arena proporción 1:3 y adehcon, con juntas promedio de 2 mm color negro juntex.', 1),
	(138, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Piezas de 2 canales de policoncreto con dimensiones de 0.20m x 0.40 m, con espesor de 2.2 cms y una absorcion de humedad menor al 0.9%,y resistencia de 900 a 1528 kg/cm^2, color amarillo transito; colocada con pegamento epoxico s.m.a. y solera de 1 1/2"x 3/8" colocadas a canto fijadas a la plataforma por varillas de 3/8" y taquetes químicos epoxicos.', NULL),
	(139, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Piezas de puntos para cambio de dirección, de policoncreto con dimensiones de 0.20m x 0.20 m, con espesor de 2.2 cms y una absorcion de humedad menor al 0.9%,y resistencia de 900 a 1528 kg/cm^2, color amarillo transito; colocada con pegamento epoxico s.m.a. y solera de 1 1/2"x 3/8" colocadas a canto fijadas a la plataforma por varillas de 3/8" y taquetes químicos epoxicos.', NULL),
	(140, 'Línea de seguridad', 'Pieza de señalizacion en piso lisa, cuyo color de contraste indica el limite de espera de la unidad para prevenir accidentes. ', 'Piezas de línea de seguridad de cerámica de 10x20 cm. en color amarillo transito, colocada con mortero cemento-arena en proporción 1:3 y con junta a hueso, para acceso en puertas de servicio.', NULL),
	(141, 'Muros en plataforma', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Muro de concreto armado e= 10 cms,  acabado interior y exterior  aparente , rayado horizontalmente con buñas de 1/2" @ 10 cms y recubierto con pintura epoxica color gris con móduloscon rejillas tipo louver para ventilación de 1.20m x 0.50m  montadas, emboquilladlas y recubiertos con pintura negro mate.', NULL),
	(142, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Muro de concreto armado de 30cm de espesor con pintura. concreto alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2  y  ducto para ventilación a base de polietileno de alta densidad ( p. a. d. ) ø=4" ( 102 mm ), con acabado aparente y recubierto con pintura gris, ,  colado integral junto con nariz de anden.  ', NULL),
	(143, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', 'Losa de concreto armado de 20.85m x 0.30m y 15cm de espesor, para remate de anden  con acabado pulido y martelinado en secciones, concreto de alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2   y recubierto con pintura gris por la parte frontal e inferior, colado intagral junto con muro deflector.', NULL),
	(144, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajoanden para personal de mantenimiento.', 'Tapa de concreto armado con marco de ángulo  2” x ¼”de y contramarcos de ángulo de 2 ½ ” x 3/8”de acero inoxidable para mantenimiento en bajo anden de 0.64m x 0.77m y 0.67m x 0.94m y un espesor de 10cm,  recubiertas de piso de recinto negro laminado antiderrapante de 0.40 x 0.40m y con jaladeras de redondo.', NULL),
	(145, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Portón de acceso compuesto por dos hojas abatibles de  placa de acero inoxidable 1/2" con acabado pulido con 2 topes limite, un cerrojo, 2 pasadores a piso, 4 casquillos en piso y 4 tejuelos, placa perforada con logo Metrobús y logo de la CDMX todos los elementos recubiertos con pintura negro mate.', NULL),
	(146, 'Cortinas en puertas de servicio', 'Cortinas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Cortinas enrollables con funcionamiento eléctrico mediante operador tubular instalado dentro de flecha de enrollamiento que incluye freno electromagnético, protector térmico y micros de paro u operación manual para casos de emergencia mediante reducción por engranes planetarios, de tabletas de aluminio calibre 16" color natural, cribada con perforaciones de 2.38mm de operación Eléctrica/manual con chapa y llave correspondiente a cada cortina. Primer cortina de 4.410 m de ancho por 2.30 m de alto mas rollo, segunda cortina de 2.53 m de ancho por 2.30 m de alto mas rollo y tercer cortina de 2.44 m de ancho por 2.30 m de alto mas rollo, (por sentido de circulación).', NULL),
	(147, 'Estructura', 'Conjunto de elementos horizontales y verticales enlazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columnas de viga IPR de acero estructural de ½” una resistencia de  44.80 kg/m de 10 ½” x 5 3/4”  por 4.40 m de altura ubicadas a 6.00m  entre  ejes de estación para recibir viga IPR transversal de acero estructural longitudinal superior de ½” de 8” x 4” con una distancia variada entre ejes de columnas y piernas de cortina, cubiertas por lamina  de remate de ¼” para el paso de instalaciones eléctricas, recubiertos con pintura negro mate.', NULL),
	(148, 'Piernas y cubrerollos de cortinas', 'Conjunton de placas de acero horizontales y verticales enlazados entre si para proteger el funcionamiento de las cortinas de servicio.', 'Marco para riel de cortina enrollable en puertas de anden de perfil "or" de acero de 4 x 4" para fijacion de guias de cortina y tubos para cables de regreso y embrague de sitema eléctrico a mecánico o visceversa,  compuesto a base de placas de acero de e= ½”. De 0.23m x 0.33m por una altura de 2.30m. Marco para cortina enrollable en puertas de anden compuesto a base de placas de acero de e= ½” de 0.53m x 0.70m y un largo variable dependiendo de la puerta de servicio, soldado integral con piernas.', NULL),
	(149, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', '1)Piezas de torniquete de entrada de acero inoxidable adicionados con validadores de tarjetas. 2) Piezas de torniquete de salida de acero inoxidable. 3) maquinas expendedoras. 4) Pieza de garita compuesta por tubular de acero inoxidable de 1” y señalética de acrílico adicionado con validadores de tarjetas. 5) barandales encauzadores a base de soleras y tubo circular "oc" de acero inoxidable, 6) 1 cámara fijada a la estructura. 7) Contacto trifásico con tapas de seguridad para planta de emergencia. ', NULL),
	(150, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', '1)Tactograma de acero inoxidable con placas de 0.25m x 0.25m soldados a placa de ¼” y tubular de acero inoxidable de 1” x 0.17m de largo,  con estructura base de tubo de acero inoxidable de 3" por 1.00 m de altura o soldado a tubo cubremampara de 3” sin base. 2) botonera de encendido de torreta fijada a pierna de 1er puerta de servicio con señalética a un costado tipo Tactograma de acero inoxidable de 20m x 20m. 3) botonera de apagado exterior con tubo de 3" por 1.00 m y caja para operador. 4) torreta giratoria con luz indicadora de acceso fijada a estructura exterior. 5) botonera de audio de programa de corridas fijada a estructura. 6) placa en piso de policoncreto de  0.40m x 0.40m x 5cm colocadas a losa de concreto armado con mortero cemento-arena proporción 1:3 y adehcon, con juntas promedio de 2 mm color azul con logo blanco de discapacitados.', NULL),
	(151, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lamina de 0.36x0.21x0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21x0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. De capacidad ubicado dentro de gabinete.', NULL),
	(152, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Viga IPR de ½”  una resistencia de 22.40 kg/m atornillada transversalmente a cada 6.00m en ejes de columnas IPR  de ½” x 44.80 kg/m, con una longitud de 7.296m para recibir  longitudinalmente larguero de perfil  tubular PTR cuadrado de 102x4.8 mm, recubiertos por pintura negro mate, para la fijacion de lamina multi celular de policarbonato de 16mm de espesor con 5 celdillas horizontales y factor de aislamiento térmico ("k"=1.53w/m2c) con espaciador de aluminio cerchado en la unión de las laminas para brindar mayor rigidez, perfil conector tipo "u" 2000 de policarbonato para unión de laminas fijo en forma mecánica (prefabricada) a las pestañas laterales de la lamina para su unión y remate en extremos longitudinales a base de lamina galvanizada cal. 14 o en aluminio anodizado cal. 14 fijo en un solo extremo con cinta gris 3m de 2" para sellar las celdillas de la lamina de policarbonato.', NULL),
	(153, 'Sistema de Tierras y Puntas Pararayos ', 'Sistema para retencion de descargas por tormenta elctrica y proteger a los equipos de mantenimiento y de comunicación al interior de la estación.', 'Cable desnudo  de 8 hilosque pasa atravez de la estructura desde el bajo anden hasta la techumbre .  Punta faraday macisa de acero ioxidable pulida con cuerda en un extremo fijada a techumbre de policarbonato.', NULL),
	(154, 'Mamparas de cristal', 'Elemento de cerramiento transparente perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Cristal templado doble de 1.0cm + 1.0cm  con unión de PBV transparente con cenefa de MB o Nombre de estación y dimensiones de alto y ancho variables.', NULL),
	(155, 'Señalética interior y exterior', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Estructura de tipo puente  con señalética restrictiva-informativa de 0.50m x 3.00m de acero inoxidable ubicadas a una altura de 2.90m con rotulación adherida a lamina, señalamiento interior y exterior tipo rotulo adheridos a estructura y mamparas de cristal, señalamiento tipo placa soldados a estructura y puertas de Módulo de Servicios, señalamientos tipo lamina fijados a nariz de anden.', NULL),
	(156, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija, con tapas de seguridad fijados en columnas de viga IPR.', NULL),
	(157, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Gabinete metálico de 0.25 m x 0.20 m x 0.15 m, tipo himel', NULL),
	(158, 'Luminarias de plataforma', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte lateral de la estructura  a lo largo de la plataforma  (lecho bajo de la cubierta).', ' Luminaria tipo arbotante con iluminación directa e indirecta, forma medio circulo, cuerpo de aluminio fundido a presión, acabado de pintura poliéster en polvo aplicada electrostáticamente en color aluminio natural, reflector segmentado de aluminio refractor de vidrio plano termotemplado, con lámpara de descarga de 70 watts de aditivos metálicos, para operar a 127 vca, 60 Hz. ', NULL),
	(159, 'Encauzador de módulo', 'Elemento estructural metálico que delimita y dirigen circulación de los usiarios a la zona de modulo de servicios.', 'Marco conformado por viga IPR de 6"x4"x1.20m soldada a placa en piso en los laterales, y remate de solera superior de 4" x largo variable x 3/4" de espesar; y 12 Tubulares de 3/4" de diámetro distribuidos, con un largo entre 0.92 a 1.34 m, recubierta con pintura negro mate.', NULL),
	(160, 'Piso de cerámico negrol', 'Material de recubrimiento en piso sobre el cual transitan los usuarios que hacen uso de la estación en la zona del módulo de servicios.', 'Piezas de piso ceramico negro  antiderrapante de 0.40m x 0.40m x 2cm colocadas a losa de concreto armado con mortero cemento-arena proporción 1:3 y adehcon, con juntas promedio de 2 mm color negro juntex.', NULL),
	(161, 'Zoclo en muros', 'Material de recubrimiento en parte inferior de muros de los cuartos del módulo de servicios.', 'Piezas de piso ceramico antiderrapante de 0.10m x 0.40m x 2cm colocadas a muros de concreto armado  con mortero cemento-arena proporción 1:3 y adehcon, con juntas promedio de 2 mm color negro juntex.', NULL),
	(162, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la plataforma de la estación hasta el sanitario en el módulo de servicios.', 'Piezas de 2 canales de policoncreto con dimensiones de 0.20m x 0.40 m, con espesor de 2.2 cms y una absorcion de humedad menor al 0.9%,y resistencia de 900 a 1528 kg/cm^2, color amarillo transito; colocada con pegamento epoxico s.m.a. y solera de 1 1/2"x 3/8" colocadas a canto fijadas a la plataforma por varillas de 3/8" y taquetes químicos epoxicos.', NULL),
	(163, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de botón circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Piezas de puntos para cambio de dirección, de policoncreto con dimensiones de 0.20m x 0.20 m, con espesor de 2.2 cms y una absorcion de humedad menor al 0.9%,y resistencia de 900 a 1528 kg/cm^2, color amarillo transito; colocada con pegamento epoxico s.m.a. y solera de 1 1/2"x 3/8" colocadas a canto fijadas a la plataforma por varillas de 3/8" y taquetes químicos epoxicos.', NULL),
	(164, 'Muro deflector', 'Elemento que forma parte de la cimentación del módulo de servicios .Su estructura sólida y con características de contención, protege la circulación y estancia de los usuarios. Este muro delimita y protege también el espacio en el bajo andén.', 'Muro de concreto armado de 30cm de espesor con pintura. concreto alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2  y  ducto para ventilación a base de polietileno de alta densidad ( p. a. d. ) ø=4" ( 102 mm ), con acabado aparente y recubierto con pintura gris, ,  colado integral junto con nariz de anden.  ', NULL),
	(165, 'Señalética interior ', 'Conjunto de señalamiento visual informativo en el interior de la estación: En la zona de módulo de servicios, indica los cuartos asignados para sanitarios de uso público, así como los espacios exclusivos para personal de mantenimiento de la estación.', 'Letrero "sanitarios y solo personal autorizado" a base de acrílico de 0.20 X 0.20 m, y  placas de tactograma de acero inoxidable con placas de 0.22 x 0.15 m.', NULL),
	(166, 'Puertas en módulo de servicios', 'Puertas para cierre de los cuartos de servicio y sanitarios en el área de módulos de servicio.', '1) Cuarto de medidores: Puerta forjada a base de bastidor de PTR de 1 ½” forrado con lamina calibre 14  de 1.20m x 2.13m con jaladeras de redondo o ángulo, pasador interior  y contramarco de acero de 4” x ½”. 2) sanitario para discapacitados: Puerta forjada a base de bastidor de PTR de 1 ½” forrado con lamina calibre 14  de 1.20m x 2.15m y rejilla de ventilación inferior tipo louver, con jaladeras de redondo o ángulo, pasador interior  y contramarco de acero de 4” x ½”. 3) Sanitario mixto, rack y servicio: Puertas forjadas a base de bastidor de PTR de 1 ½” forrado con lamina calibre 14  de 0.90m x 2.13m con jaladeras de redondo o ángulo, pasador interior y contramarco de acero de 4” x ½”. Todas recubiertas con pintura negro mate.', NULL),
	(167, 'Tapas de registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las instalaciones hidrosanitarias y eléctricas de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Registro cuadrado  de 1.10m x 1.10m de  concreto armado con marco de ángulo  2” x ¼”de y contramarcos de ángulo de 2 ½ ” x 3/8”de acero inoxidable para mantenimiento en bajo anden con tapa doble de 0.55m x 0.55m y un espesor de 10cm,  recubiertas de piso de recinto negro laminado antiderrapante de 0.40 x 0.40m y con jaladeras de redondo.', NULL),
	(168, 'Accesorios y muebles sanitarios ', 'Tienen la finalidad de dar servicio de manera accesible para los servicios sanitarios. Cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', '1) Sanitario para discapacitados: W.C. de acero inoxidable con fluxómetro para descarga de agua tipo botón, lavabo de acero inoxidable con llave de nariz empotrado en muro con plancha de concreto forrada con recinto negro, soporteria de acero inoxidable para W.C. de discapacitados, coladera a piso, jabonera, perchero, papelera portarrollos, dispensador de toallas de acero inoxidable, cambiador plástico retráctil y espejo, todos empotrados a muros de cuarto. 2) Sanitario Mixto: Combo W.C.-lavabo  de acero inoxidable con fluxómetro para descarga de agua tipo botón, mingitorio de acero inoxidable con botón de descarga de agua, coladera a piso, jabonera, perchero, papelera portarrollos, dispensador de toallas de acero inoxidable, todos empotrados a muros de cuarto. 3) Cuarto de servicio: Tarja de acero inoxidable tubo de fo.fo. para bajada de agua pluvial y coladera en piso.', NULL),
	(169, 'Apagadores', 'Dispositivos de encendido y apagado de las luminarias en los cuartos y sanitarios del módulo de servicio.', 'Placa con apagador sencillo tipo quinziño dorado incluye chasis y tornillería, placa fabricada en aluminio acabado dorado.', NULL),
	(170, 'Luminarias en módulo', 'Fuente de iluminación para los usuarios en los cuartos y sanitarios del módulo de servicios.', 'Luminaria tipo downlight para sobreponer cuadrada de 0.236 m por lado equipada con fuente de luz LED, con cuerpo de aluminio de una aleación especialmente formulada para resistir la corrosión y una pantalla difusora de luz que reduce el deslumbramiento de la fuente luminosa y proporciona una distribución simétrica y homogénea para luz general, driver electrónico remoto con un rango de tensión de 100-240 V~ que lo hace más resistente a las variaciones de voltaje.', NULL),
	(171, 'Muros de módulo ', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Muro de concreto armado e= 10 cms, acabado fino y recubierto de pintura epoxica color blanco por la parte interior , aplicado a dos manos como mínimo o en las capas que sean necesarias, acabado exterior  aparente , rayado horizontalmente con buñas de 1/2" @ 10 cms y recubierto con pintura epoxica color gris con móduloscon rejillas tipo louver para ventilación de 1.20m x 0.50m  montadas, emboquilladlas y recubiertos con pintura negro mate.', NULL),
	(172, 'Techumbre de concreto', 'Cierre superior que sirve para proteger a los usuarios en el interior del módulo de servicios, de los factores climáticos.', 'Losa de concreto armado, espesor de 12cm con armado de acero de refuerzo fy=4200 kg/cm^2  con cimbra y acabado aparente en lecho bajo, chaflan a 45° y entortado de concreto simple de 5 cm fc=100 kg/cm^2, impermeabilizante hidroprimer en toda la superficie, incluyendo el chaflán, hasta cubrir perfectamente e impermeabilizante morther-plas color aluminio para cubrir la superficie de la azotea, chaflán y hasta 15 cm de pretil, rematando en una buña perteneciente al mismo pretil.', NULL),
	(173, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m x 0.10 m, vialeta metálica de 0.10 m x 0.11 m, vialeta plástica de 0.10 m x 0.11 m, súper vialeta de 0.20 m x 0.045 m, vialeton de 0.25 m x 0.05 m, galibo de 1.80 m x 0.06 m, botón metálico de 0.10 m de diámetro, botón metálico de 0.13 m de diámetro, boyas metálica de 0.20 m de diámetro, ', NULL),
	(174, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo Metrobús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(175, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(176, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(177, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(178, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', 'Losa de concreto armado de 20.85m x 0.30m y 15cm de espesor, para remate de anden  con acabado pulido y martelinado en secciones, concreto de alta resistencia con endurecedor fc=250 kg/cm^2 armado con acero de refuerzo fy=4200 kg/cm^2   y recubierto con pintura gris por la parte frontal e inferior, colado intagral junto con muro deflector.', NULL),
	(179, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Elemento sólido de polietileno reciclado en forma piramidal de una sola pieza, que incluya en la parte interior un alma de acero, con reflejante en grado diamante, medidas de ancho: 0.365 m x altura 0.45 m', NULL),
	(180, 'Línea de seguridad', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', 'Línea de seguridad tipo basaltex estriado 60 x 10 x 5 cms de espesor dejando juntas de 5 mm aproximadamente, color beige o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color beige.', NULL),
	(181, 'Piso de basaltex negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso de loseta tipo basaltex antiderrapante en piezas de 30x30x5 cms de espesor, dejando juntas de 5 mm aproximadamente, color negro o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color negro.', NULL),
