	(183, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 30 cm x 30 cm x 5cm de espesor de basaltex color beige o equivalente en calidad, textura y color, dejando juntas de 5 mm aproximadamente, color beige o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color beige.', NULL),
	(184, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro eléctrico de 55.0 x 70.0 cm. de ladrillo de lama de 5.5 x 11.0 x 22.0 cm, a soga, asentado y aplanado con mortero cemento - arena 1:4, con cama de grava de 5.0 cm de espeso, tapa de registro de placa de acero de 1/4" con medidas 0.50m x 0.65m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.30m x 2.5 cms de espesor', NULL),
	(185, 'Banqueta de media luna', 'Base sobre la cual se desplanta semaforo peatonal.', 'Firme de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con malla electrosoldada 6x6 10/10, preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado.', NULL),
	(186, 'Guarniciones', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del semaforo peatonal.', 'Elemento de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con varilla 3/8", preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado, con acabado en pintura esmalte amarillo tránsito.', NULL),
