	(200, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Registro eléctrico de 65.0 x 65.0 cm. de ladrillo de lama de 5.5 x 11.0 x 22.0 cm, a soga, asentado y aplanado con mortero cemento - arena 1:4, con cama de grava de 5.0 cm de espeso, tapa de registro de placa de acero de 1/4" con medidas 0.60m x 0.60m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.30m x 2.5 cms de espesor', NULL),
	(201, 'Barandal', 'Elemento de cerramiento perimetral del Parabus, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Barandal de solera de acero de 4" x 1/2" con soporte horizontal de 2" x 1/2" y soportes verticales de solera de 4" x 1/2" a cada 1 m, fijada en base por angulo de 2 1/2" de un calibre de 1/2" y con taquetes expansivos de 3" a cada 50 cm.', NULL),
	(202, 'Cortina de servicio', 'Cortinas para el cierre de la estación cuando esta se encuentre fuera de servicio, en zona de acceso a estación, ascenso y descenso al autobus.', 'Cortina enrrrollable con funcionamiento eléctrico mediante operador tubular instalado dentro de la flecha de enrrollamiento que incluye freno electromagnético, protector termico y micros de paro u operación manual para casos de emergencia mediante reducción por engranes planetarios, de tabletas de aluminio calibre 16" color natural cribada con perforaciones de 2.38 mm de operación Eléctrica/manual con chapa, llave, marcos y guias correspondiente a cada cortina. Primer, segunda, tercer y cuarta cortina de servicio 2.20 m de ancho por 2.50 m de alto más rollo,  primer cortina de acceso 2.85 m de ancho por 2.85 m de alto más rollo, segunda cortina de acceso 7.50 m de ancho por 2.50 m de alto más rollo, con caja guarda cortina de placa de acero de 1/4" con pintura negra mate de 0.42 m X 52 m X (Ancho de cortina) (San Lázaro Oriente y Poninete).  Primer, segunda, tercer y cuarta cortina de servicio 2.20 m de ancho por 2.50 m de alto más rollo,  primer cortina de acceso 6.50 m de ancho por 2.85 m de alto más rollo, segunda cortina de acceso 5.90 m de ancho por 2.85 m de alto más rollo, con caja guarda cortina de placa de acero de 1/4" con pintura negra mate de 0.42 m X 52 m X (Ancho de cortina) (Buenavista).', NULL),
	(203, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columna metálica, hecha a base de perfil metalico OC 8" ced. 80 con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro, viga metálica de 30 cm (peralte) x 13 cm (patín) x 11 mm (alma) cm con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro,  PTR estructural de 6" x 4" x 1/4" de espasor soldado a ménsula con una capa de primer y dos manos de pintura alquidálica color negro. ', NULL),
	(204, 'Piernas y cubrerollos de cortinas', 'Conjunton de placas de acero horizontales y verticales enlazados entre si para proteger el funcionamiento de las cortinas de servicio.', 'Marco para riel de cortina enrollable en puertas de anden de perfil "or" de acero de 4 x 4" para fijacion de guias de cortina y tubos para cables de regreso y embrague de sitema eléctrico a mecánico o visceversa,  compuesto a base de placas de acero de e= ½”. De 0.23m x 0.33m por una altura de 2.30m. Marco para cortina enrollable en puertas de anden compuesto a base de placas de acero de e= ½” de 0.53m x 0.70m y un largo variable dependiendo de la puerta de servicio, soldado integral con piernas.', NULL),
	(205, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encauzador de acero , cámaras de videovigilancia y pantallas informativas.', NULL),
	(206, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'Tactograma de acero inoxidable con placas de 0.15m x0.15m (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable fijada a MUPI de publicidad; botonera de encendido de torreta fijada a pierna de 2da y 4ta puerta de servicio con temporizador; torreta giratoria con luz indicadora de acseso fijada a estructura; botonera de audio de programa de corridas (1 pza por sentido general).', NULL),
	(207, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lámina de 0.36 x 0.21 x 0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21 x 0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. de capacidad ubicado dentro de gabinete.', NULL),
	(208, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Viga metálica de 20 cm (peralte) x 12 cm (patín) x 9 mm (alma) cm con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro, canal metálico de remate perimetral "U CPS" de 30 cm (peralte) x 8 cm (patín) x 10 mm (alma) con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro, lámina de policarbonato celular Dampalón tipo  "multicell" de 16 mm de espesor en color Refrective Grey, colocada por perfil conector tipo "U" de aluminio y sujetadores de acero inoxidable para la fijación de la lámina a la estructura y colocación de tapas de aluminio para sellar los extremos del perfil conector, canal metálico de remate perimetral "U CPS" de 30 cm (peralte) x 8 cm (patín) x 10 mm (alma) con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro, franja de plafón corrido de panel de yeso de 13 mm. de espesor tipo similar en calidad Tablarroca WR sobre bastidor metálico de tubulares de 2" calibre 18 fijado a estructura principal con acabado en pintura vinilica color blanco mate.', NULL),
	(209, 'Sistema de Tierras y Puntas Pararayos', 'Sistema para retención de descargas por tormentas eléctricas y proteger a los equipos de mantenimiento y de comunicación al interior de la estación.', 'Cable desnudo de 8 hilos que pasa atravez de la estructura desde el bajo hasta la techumbre. Punta Faraday  macisa de aceso inoxidable pulida, con cuerda en un extremo fijada a techumbre de policarbonato.', NULL),
	(210, 'Bastidor para mamparas', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'PTR estructural de 6" x 4" x 1/4" de espasor soldado a ménsula con una capa de primer y dos manos de pintura alquidálica color negro.', NULL),
	(211, 'Mamparas de cristal', 'Elemento de cerramiento transparente perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Ménsula metalica de 2" de espesor soldada a columna con una capa de primer y dos manos de pintura alquidálica color negro, cristal templado de 9.0+9.0 mm con union de PBV transparente con cenefa de MB o nombre de estacion y dimenciones de alto 2.90m y ancho variable, espaciador y conector tipo Kinetic con chapetón y birlo fabricado en acero inoxidable pulido para mantener firmemente el cristal, fija el cristal a uan distancia de 44 mm de su anclaje.', NULL),
	(212, 'Señalética interior', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Ruta de evacuación de 0.40 m X 0.20 m, estructura de tipo puente  con señalética restrictiva-informativa de 2.80 X0.40 de acero inoxidable ubicadas a una altura de 2.90m con rotulación adherida a lamina, señalamiento interior y exterior tipo rotulo adheridos a estructura y mamparas de cristal, señalamiento tipo placa soldados a estructura.', NULL),
	(213, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex , cuerpo y cara de termoplástico y nylon con cara lisa permite que no guarda suciedad, con 4 pestañas 1 en cada esquina que garantizan la seguridad al colocarlo.', NULL),
	(214, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Gabinete metálico de 0.25 m x 0.20 m x 0.15 m, tipo himel, colocado mediante pijas para metal a columna de acero.', NULL),
	(215, 'Luminaria en piso', 'Fuente de iluminación para la fachada de la estación, ubicadas en la parte inferior de mamparas de cristal sobre la guarnición de la plataforma.', 'Luminario empotrado en piso tipo Ventor Modelo IL/2 Studio con lampara tipo 20, 50w.', NULL),
	(216, 'Luminarias plafón', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona central a lo largo de la plataforma  (lecho bajo de la cubierta).', 'Lampara empodrado aluminio bote/plafón fluorescente fabricada en acero y aluminio terminado en color blanco, cristal concentrico y foco ahorrador de 13 watts.pendiente', NULL),
	(217, 'Luminarias de plataforma', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte lateral de la estructura  a lo largo de la plataforma  (lecho bajo de la cubierta).', 'Luminaria tipo arbotante con iluminación directa e indirecta, forma medio circulo, cuerpo de aluminio fundido a presión, acabado de pintura poliéster en polvo aplicada electrostáticamente en color negro, reflector segmentado de aluminio refractor de vidrio plano termotemplado, con lámpara de descarga de 70 watts de aditivos metálicos, para operar a 127 vca, 60 Hz. ', NULL),
	(218, 'Parabus', 'Cierre superior que sirve para proteger a los usuarios, de los factores climáticos.', 'Banco completo de acero inoxidable, marco de aluminio CCI, mástil derecho, mástil central, mástil izquierdo, cuaderna central, cuaderna extremo, módulo, tubo inferior de cristal, pieza de unión módulo+tubo, tubo cubierta doble, apoyo isquiático, pletina cierre central, pletina cierre lateral, pletina cierre lateral sim, perfil embellecedor movil, perfil embellecedor fijo, tapa mástil junquillo y cristal de 9 mm.', NULL),
	(219, 'Estela', 'Señalamiento exterior en forma vertical que indica el nombre de la estación, plano de ruta y plano de barrio.', 'Placa base con espesor de 7.5 cm. x 25.0 cm x 13 mm de espesor, Doble PTR estructural de 3" x 3" x 1/4" de espesor soldados a placa base con acabado primer anticorrosivo a dos manos, bastidor PTR estructural de 3" x 3" x 1/4" de espesor de 0.345 m x 2.95 m con refuerzos a 0.935 m. de PTR estrctural de 3" x 3" x 1/4" de espesor con acabado de primer anticorrosivo a dos manos. Paneles porcenalizados con lámina de acero calibre 18 serigrafiado color s.m.a con sustrato de aglomerado de cemento y madera de 8 mm. adherido en la trascara, placa para accesibilidad de alto relieve hechas en placa de acero inoxidable calibre 18 soldado a PTR estructural de 3" x 3" x 1/4" y este a bastidor de estela, torreta temporalizada alojada en cara de estela a base de estrobo modelo Fire Bolt Plus Mca. Federal Signal color ambar con chapetón, luminarias empotradas en cantos laterales de panel superior con lámpara fluorescente compacta de bajo consumo modelo Master PL-L Xtra Polar 4 Pin Mca. Phillips, luminaria en cara frontal superior de Led, Mca. Phillips con difusor de acrilico gabinete rectangular con caja de montaje empotrable de 10 cm x 20 cm.', NULL),
	(220, 'Piso de basaltex negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', 'Piso de loseta tipo basaltex pulido en piezas de 30x30x5 cms de espesor, dejando juntas de 5 mm aproximadamente, color negro o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color negro.', NULL),
