	(222, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Guía táctil de dirección 30 cm x 30 cm x 5cm de espesor de basaltex color beige o equivalente en calidad, textura y color, dejando juntas de 5 mm aproximadamente, color beige o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color beige.', NULL),
	(223, 'Guarnición en módulo de servicios', 'Elemento que forma parte de la cimentación, su estructura sólida y con  caracteristicas de contensión, protege la circulación de los usuarios.', 'Guanición tipo basaltex pulido en piezas de 60x50x15 cms de espesor, dejando juntas de 5 mm aproximadamente, color negro o equivalente a calidad, textura, asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex color negro.', NULL),
	(224, 'Señalética interior ', 'Conjunto de señalamiento visual informativo en el interior de la estación: En la zona de módulo de servicios, indica los cuartos asignados para sanitarios de uso público, así como los espacios exclusivos para personal de mantenimiento de la estación.', 'Letrero "sanitarios y solo personal autorizado" a base de acrílico de 0.20 X 0.20 m, y  placas de tactograma de acero inoxidable con placas de 0.22 x 0.15 m.', NULL),
	(225, 'Puertas en módulo de servicios', 'Puertas para cierre de los cuartos de servicio y sanitarios en el área de módulos de servicio.', 'Puertas de Módulo de Atención 0.90 x 2.10 m., cuarto eléctrico o cuarto de jaguar 1.35 x 2.10 m., cuarto de hidroneumático 1.20 x 2.10 m., sanitario para discapacitados 1.50 x 2.10 m. y cuentan con ventanas tipo louver 0.80 x 0.40 m. aproximadamente, cuarto de aseo y lockers son puertas dobles de 0.60 m. (cada puerta) x 2.10 m. fabricadas a base de bastidor perfil tubular galvanizado de 1 1/2" recubierto de lamina porcelanizada cal. 18 tipo Alfher Porcewool color negro grafito.', NULL),
	(226, 'Tapas de registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las instalaciones hidrosanitarias y eléctricas de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Tapa Marco de ángulo de 3/16" x 1" colada con concreto 0.80m x 0.60m y recubierta de loseta tipo basaltex color negro 30cm x 30cm x 2.5cm.', NULL),
	(227, 'Accesorios y muebles sanitarios ', 'Tienen la finalidad de dar servicio de manera accesible para los servicios sanitarios. Cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', 'Inodoro redondo American Standard modelo "Cadet PRO NH RF" 3517D101 de 4.8 lts. de descarga de ceramica porcelanizada color blanco, Mingitorio de ceramica porcelanizada color blanco para montar en pared, con acción de descarga de lavado decendente, entrada de superior de 1/2" y llave de paso de bronce de 1/2", lavabo Lugano de ceramica porecelanizada color blanco con llave economizadora de latón acabado en cromo, sobre meseta de concreto y recubierta por azulejo veneciano de 2 x 2 cm color negro escarlata, asentado con pega azulejo, soportaría para discapacitados, jabonera, perchero, papelera portarrollos, espejo, lavabo  y cambiador.', NULL),
	(228, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(229, 'Apagadores', 'Dispositivos de encendido y apagado de las luminarias en los cuartos y sanitarios del módulo de servicio.', 'Apagador doble estándar a 120 v de voltaje y 15 amperes de corriente alterna con tapa para caja chalupa con salida', NULL),
	(230, 'Luminarias en módulo', 'Fuente de iluminación para los usuarios en los cuartos y sanitarios del módulo de servicios.', 'Luminaria para sobre poner de 30 x 30 x 12 cm con difusor prismatico envolvente libre de tornilleria, con una lampara incandecente de 60 watts o flourescente compacta de 26 watts con reflector de aluminio especular para operar a 120 VCA 60 HZ, luminaria de gabinete para empotrar en plafón fabricada en metal/plástico en color aluminio de 59.8 x 59.8 x 7 cm con 4 tubos flourecentes de 2x17 watts', NULL),
	(231, 'Muros de módulo ', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Cadena de concreto armado para desplante de muro, armada con 4 varillas de no. 3 y anillos del no. 2 @ 20 cm. Muro de tabique doble hueco de alta recistencia de 12 x 12 x 23 cm. modelo Tambicimbra tipo Novaceramic, asentado con mortero cemento - areana proporción 1 : 4 con juntas de 1 cm. de espesor línea para repellar y cadena de concreto para remate de muro y desplante de canceleria, armada con 4 varillas de no. 3 y anillos del no. 2 @ 20cm. Tablero arquitectónico porcelanizado calibre 18 Tipo Alfher Porcewol para fachada en color negro grafito con sustrato de fibrocemento de 6 mm. de espesor en la trascara fijado a bastidor metálico de tubular galbanizado de 2" x 2" calibre 14 con acabado anticorrosivo y taquetes expansivos para su fijación a muro. Aplanado fino cemento - arena con pintura vinílica color blanco mate. Recubierta por azulejo veneciano de 2 x 2 cm color negro escarlata, asentado con pega azulejo.', NULL),
	(232, 'Muros de módulo (Secundario)', 'Cierre de espacios al interior del módulo de servicios.', 'Muro divisor de Tablaroca de 10 cm. de espesor a dos caras con postes de 63 mm. con acabado final en pintura vinilica color blanco mate.', NULL),
	(233, 'Canceleria', 'Cerramiento de muros en módulo de servicios y divisiones en interior de módulo de servicios.', 'Canceleria interior a base de perfiles de aluminio tipo bolsa acabado anodizado natural de 2" con cristales claros de 9 mm. de espesor con respectivas películas de seguridad transparente  y banda esmerilada, cristal  claro de 9 mm x 50 cm de altura pegado a hueso sobre portavidrios de aluminio natural de 19 mm.', NULL),
	(234, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columna metálica, hecha a base de perfil metalico OC 8" ced. 80 con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro. Ménsula hecha de placa metalíca de 1/2" de espesor soldada a columna con una capa de primer de cormato de zinc y dos manos de pintura alquidálica color negro para apoyo de viga metálica, viga metálica de 20 cm (peralte) x 10 cm (patín) x 6.8 mm (alma) cm con una mano de primer de cormato de zinc y dos manos de pintura alquidálica color negro. Repisa de mdf de 9 mm. acabada en laca automotiva color negro semimate sobre bastidor metálico hecho de perfiles tubulares de 1" calibre 18 soldado a viga.', NULL),
	(235, 'Techumbre de concreto', 'Cierre superior que sirve para proteger a los usuarios en el interior del módulo de servicios, de los factores climáticos.', 'Losa de azotea de 13 cm. de espesor hecha en losa-acero a base de lámina galveteck 25, calibre 22, con una capa de compresión de 5 cm. con concreto f´c=250 kg/cm² y malla electrosoldada 6 x 6, 10 - 10e impermeabilizante de asfaltos modificados APP de 4 mm. de espesor acabado hojueleado.', NULL),
	(236, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m x 0.10 m, vialeta metálica de 0.10 m x 0.11 m, vialeta plástica de 0.10 m x 0.11 m, súper vialeta de 0.20 m x 0.045 m, vialeton de 0.25 m x 0.05 m, galibo de 1.80 m x 0.06 m, botón metálico de 0.10 m de diámetro, botón metálico de 0.13 m de diámetro, boyas metálica de 0.20 m de diámetro, ', NULL),
	(237, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo Metrobús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(238, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(239, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(240, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(241, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Accesorio imprescindible para delimitar zonas peatonales, banquetas, camellones, etc. Medidas: Ancho 36.5 cm cada cara Largo 45.0 cm cada cara Altura Total 65 cm Dado de Anclaje 36.5 cm de diámetro * Reflejante: Amarillo Grado Ingeniería.', NULL),
	(242, 'Línea de seguridad', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', '0.30mx0.30mx0.06m. tipo basaltex estriado color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(243, 'Piso de recinto gris', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', '0.30mx0.30mx0.06m tipo basaltex en color negro. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', 1),
	(244, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', '0.30mx0.30mx0.06m tipo basaltex con lineas sobre relieve en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(245, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', '0.30mx0.30mx0.06m tipo basaltex con tachones en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(246, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro de SEMEX concreto armado y tapa para mantenimiento de canalización a semáforos y luminarias en estelas, recubierta de piso de recinto gris antiderrapante y con jaladeras de redondo para su mantenimiento y servicio de 0.49mx0.67m Variable.', NULL),
	(247, 'Estela Informativa central', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30m x 0.30. x 1.00m variable recubierta con pintura, y saliente de anclas; placa base a la estructura de PTR De 5" X 5" X 1.50m variable y estela de prisma triangular de 0.50m por lado x 2.14m de altura recubierta y señalética de "nombre de estación en cada una de sus caras; copete triangular de 0.846m por lado x0.15m de espesor y luminarias en cada uno de sus lados.', NULL),
	(248, 'Banqueta de media luna', 'Base sobre la cual se desplanta el señalamiento tipo estela. ', 'Firme de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con malla electrosoldada 6x6 10/10, preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado.', NULL),
	(249, 'Guarniciones', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del señalamiento tipo estela. ', 'Elemento de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con varilla 3/8", preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado, con acabado en pintura esmalte amarillo tránsito.', NULL),
	(250, 'Piso de recinto negro .', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', '0.30mx0.30mx0.06m. tipo basaltex estriado color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', 1),
	(251, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', '0.30mx0.30mx0.06m tipo basaltex con lineas sobre relieve en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(252, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', '0.30mx0.30mx0.06m tipo basaltex con tachones en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(253, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. Acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2" ', NULL),
	(254, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. Acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2" ', NULL),
	(255, 'Encauzadores', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de rampa.', 'Marco conformado por viga IPR de 4"x1/4"x1.20m soldada a placa en piso en los laterales, y remate de solera superior de 4" x largo variable x 3/4" de espesaor y solera de soporte de tubular pasamanos de 1 1/2" x 1/4" y Tubulares de 1 1/2" de diámetro distribuidos, recubierta con pintura negro mate.', NULL),
	(256, 'Barandal Pasamanos', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de rampa.', 'Pasamanos doble con tubular de  de 2” de acero inoxidable en alturas de 0.75 y 0.90 mts respectivamente, a base de perfiles "oc", fijadas por medio de soldadura a perfiles IPR del encauzador.', NULL),
	(257, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Tapa de registro de placa de acero de 1/4" con medidas 0.55m x 0.75m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica.  ', NULL),
	(258, 'Luminaria en poste', 'Fuente de iluminación para  la circulación de los usuarios que transitan en la zona de rampa para acceso o salida de la estación.', 'Columna de iluminación exterior tipo kuma f08 o similar, con altura de 4.00 mts, con difusor transparente alta resistencia a impactos. diámetro de 22 cms, base de placa de 40 X 40 X 1/4" de espesor, con 4 barrenos para fijación.', NULL),
	(259, 'Línea de seguridad', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', '0.30mx0.30mx0.06m. tipo basaltex estriado color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(260, 'Piso de recinto negro', 'Material de recubrimiento en piso soblre el cual transitan los usuarios que hacen uso de la estación.', '0.30mx0.30mx0.06m. tipo basaltex estriado color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', 1),
	(261, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', '0.30mx0.30mx0.06m tipo basaltex con lineas sobre relieve en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(262, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', '0.30mx0.30mx0.06m tipo basaltex con tachones en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(263, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2".', NULL),
	(264, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2".', NULL),
	(265, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajoanden para personal de mantenimiento.', 'Tapa de registro de placa de acero de 1/4" con medidas 0.62m x 0.92m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. ', NULL),
	(266, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Portón de acceso compuesto por dos hojas abatibles de  placa de acero inoxidable 1/2" con acabado pulido con 2 topes limite, un cerrojo, 2 pasadores a piso, 4 casquillos en piso y 4 tejuelos, placa perforada con logo Metrobús y logo de la CDMX todos los elementos recubiertos con pintura negro mate.', NULL),
	(267, 'Puertas de servicio', 'Puertas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Cortinas Troqueladas, Primer cortina de 4.41 m de ancho por 2.70 m de alto mas rollo (servicio); Segunda cortina de 2.53 m de ancho por 2.70 m de alto mas rollo (acceso 1) y tercer cortina de 2.44 m de ancho por 2.70 m de alto mas rollo (acceso 2), (por sentido de circulación); con función automática por medio de interruptores y gabinete de rollo en caja de lamina de 1/2" espesor,  con pintura negro mate de 0.505 m X 0.55 m X ancho respectivamente.', NULL),
	(268, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columnas de IPR  5 3/4" x 1/2"  de altura ubicadas por ejes de estación con viga transversal superior; monten inferior y superior cuadrado para soportes de mampara de cristal; vigas IPR a ejes, canal C y perfiles PTR para recibir policarbonato con pintura negro mate; piernas estructurales de 16 1/2" de largo x 6 1/2" de ancho soldadas a columnas para riel de cortina en puertas de servicio con pintura negro mate; base tubular en escuadra a ejes de estructura ambos sentidos para colocación de puntas de pararrayos (Faraday)  con pintura negro mate.', NULL),
	(269, 'Tubo cubre mamparas', 'Elemento estructural metálico que delimita y protegn la circulación de los usiarios en la zona de plataforma.', 'Barandal tubular de acero inoxidable de  2", de 6m de largo entre columna y columna,  con soportes  de placa de 2" X 4" (variable), fijación con soldadura y la placa está anclado a las columnas.', NULL),
	(270, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encauzador de acero , cámaras de videovigilancia y pantallas informativas.', NULL),
	(271, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'Tactograma de acero inoxidable con placas de 0.22 x 0.15 m (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable; botonera de encendido de torreta fijada a columna derecha de 1er puerta de servicio; botonera de apagado exterior con tubo de 2" por 1.18 m y caja (para operador); torreta giratoria con luz indicadora de acceso fijada a estructura; botonera de audio de programa de corridas (1 pza. por sentido general), placa metálica  en piso para discapacitados de 0.20 m x 0.20 m.', NULL),
	(272, 'Extintores', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lámina de 0.36 x 0.21 x 0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21 x 0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. de capacidad ubicado dentro de gabinete.', NULL),
	(273, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Estructura a base de perfiles de acero a 572 grado 50 con pintura de esmalte intumescente epóxido, diluida con solvente especial sgf 036, con un espesor de 16 +- 2 milésimas de pulgada para garantizar protección contra fuego por 3 horas, color aluminio natural según muestra aprobada por el proyectista y cubierta con sistema imsa marca multypanel, línea arquipanel o equivalente en calidad, en módulos de 60 cms de ancho, compuestos por 2 láminas de acero liso galvanizado capa g 90, calibre 22 al exterior y 26 al interior, prepintadas con acabado kynar color maki silver al exterior y acabado poliéster estándar color arena embozado al interior, unidas por un núcleo de espuma rígida de poliuretano de 1 1/2" de espesor formando un elemento tipo sándwich con diseño de junta tipo hembra y macho sellada perimetralmente con silicón marca dow corning o equivalente en calidad color negro. Los módulos de 60 cms de ancho, serán de longitud variable, formando una sola pieza que incluye dobleces en la cumbrera, frentes y puntas, en las cuales deberá doblarse de la misma pieza de arquipanel según el plano de detalles.', NULL),
	(274, 'Sistema de Tierras y Puntas Pararayos ', 'Sistema para retencion de descargas por tormenta electrica y proteger a los equipos de mantenimiento y de comunicación al interior de la estación.', 'Cable desnudo  de 8 hilos que pasa atravez de la estructura desde el bajo anden hasta la techumbre .  Punta faraday macisa de acero inoxidable pulida con cuerda en un extremo fijada a techumbre de policarbonato.', NULL),
	(275, 'Mampara metálica', 'Elemento de cerramiento perimetral de la estación, que tiene la funcion soportar los cristales.', 'Solera de acero longitudinal .', NULL),
	(276, 'Mamparas de cristal', 'Elemento de cerramiento transparente perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Cistal templado de 9.0+9.0 mm con unión de PBV transparente de MB o Nombre de estación.', NULL),
	(277, 'Señalética interior y exterior', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Ruta de evacuación de 0.40 m X 0.20 m, letrero luminoso de nombre de estación a base de acrílico de 2.70 X 0.40 X 0.20 m a una cara, "nombre de estación" de 1.20 X 0.30 m ,calcomanía en poste  "acceso a discapacitados" de 0.12 X 0.10 m, restrictivo "recomendaciones" 0.65 X0.15 m y 0.90 X 0.15 m y señalamiento tipo puente de 2.70 X0.40 X 0.20 m, señalamiento restrictivo de galibo en lámina galvanizada calibre 16, con dimensiones de 0.60 X 0.60 m indicando la leyenda de "3.90 m", señalamiento restrictivo en lámina galvanizada calibre 16 con dimensiones de 1.00 X 0.20 m con esmalte tipo reflejante con franjas rojas y blancas inclinadas a 45 grados.', NULL),
	(278, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(279, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Gabinete metálico de 0.25 m x 0.20 m x 0.15 m, tipo himel', NULL),
	(280, 'Luminarias puertas de servicio.', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona de puertas para ascenso y descenso del autobús  (lecho bajo de la cubierta).', 'Unidad de iluminación tipo canal, para 1 lámparas fluorescentes de 32 w, arranque rápido, flujo luminoso inicial de 3100 lm. temperatura de color de 5000 °k, un balastro electrónico para operar una lámpara fluorescente de 32 w, tipo t8 de encendido rápido, con protección térmica inherente. factor de potencia mínimo de 0.90. para una tensión de alimentación de 127 vc.a., 60 hz. el cuerpo del luminario debe ser de acero reforzado formado troquelado. el gabinete tendrá un acabado blanco en pintura electrostática.', NULL),
	(281, 'Luminarias centrales', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona de estructura de mampara a lo largo de la plataforma.', 'Luminario de sobreponer en muro, carcasa de aluminio, lente de vidrio, tepeadizado color blanco, balastro multi voltaje 4,000°K, Modelo  WSR42TRTMDMVOL TLPI. Marca LITHONA, Fluorescente, 42W, 1F, 2H, 60Hz, 127V.', NULL),
	(282, 'Piso de recinto negro antiderrapante', 'Elemento a nivel de piso, que sirve de guarnición constructiva que divide el material de rodamiento vehicular con el material en piso de la zona de espera para cruce peatonal, con textura y color de contraste para personas con diascapacidad visual.', '0.30mx0.30mx0.06m tipo basaltex estriado color negro. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', 1),
	(283, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la plataforma de la estación hasta el sanitario en el módulo de servicios.', '0.30mx0.30mx0.06m tipo basaltex con lineas sobre relieve en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(284, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de botón circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', '0.30mx0.30mx0.06m tipo basaltex con tachones en color beige. Asentada con cemento - arena 1 : 4 adicionado con adhecon y junteada con agregado tipo juntex.', NULL),
	(285, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2" ', NULL),
	(286, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con un recubrimiento de lamina con un ancho de 0.40m y un espesor de 1/2" ', NULL),
	(287, 'Señalética interior ', 'Conjunto de señalamiento visual informativo en el interior de la estación: En la zona de módulo de servicios, indica los cuartos asignados para sanitarios de uso público, así como los espacios exclusivos para personal de mantenimiento de la estación.', 'Letrero "sanitarios y solo personal autorizado" a base de acrílico de 0.20 X 0.20 m, y  placas de tactograma de acero inoxidable con placas de 0.22 x 0.15 m.', NULL),
	(288, 'Puertas de cuartos en modulo de servicio', 'Puertas para cierre de los cuartos de servicio y sanitarios en el área de módulos de servicio.', 'Constituidas de caja y tapa con perfiles integrados para otorgar seguridad en el ensamble, en sus extremos se unen por electro-fusión TIG a los canales inferior y superior para estructurar y fortalecer el cuerpo de la puerta. Tiene tres soportes para bisagra de 5/32" de espesor, electro-fusionadas a la hoja, para recibir las bisagras de 4 1/2" x 4 1/2", contiene un conjunto de rejillas en forma de "V" invertida, auto contenidas en dos refuerzos verticales para formar el conjunto de rejillas superiores y/o inferiores a lo largo de la puerta, poliestireno de relleno, refuerzo de chapa/pestillo y refuerzo de cierrapuertas.', NULL),
	(289, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las instalaciones hidrosanitarias y eléctricas de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Tapa registro a bajo andén con jaladeras de redondo para su mantenimiento recubierta de piso de recinto negro y placa inferior; compuesta por dos tapas independientes de 1.20mx1.20m (variable). Estructura recubierta de primer base negro.', NULL),
	(290, 'Accesorios y muebles sanitarios ', 'Tienen la finalidad de dar servicio de manera accesible para los servicios sanitarios. Cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', 'Mueble de WC con descarga a muro, fabricado en acero inoxidable T-304 calibre 16, asiento ergonómico embutido de una sola pieza con profundidad de 1 1/2¨, alimentación de 1 1/2¨, sello de agua, céspol de 4¨ fabricado en acero inoxidable, respaldo anti derrames, ángulo redondeado de 3/4¨, con campana atrapa-cera, resistente al vandalismo, medidas: 53 cm x 36 cm x 45 cm, lavabo, Mingitorio Ecológico en acero inoxidable T-304, calibre 16 (1.5mm), armado robusto con fondo, pulido P3, montaje con ojo de llave, disponible, barra para mingitorio. Altura 60cm, Ancho 40cm, Fondo 40cm. HY061., (soporteria para discapacitados), jabonera, perchero, papelera portarrollos, espejo, lavabo, tarja, de acero inoxidable y cambiador.', NULL),
	(291, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(292, 'Apagadores', 'Dispositivos de encendido y apagado de las luminarias en los cuartos y sanitarios del módulo de servicio.', 'Apagador doble estándar a 120 v de voltaje y 15 amperes de corriente alterna con tapa para caja chalupa con salida', NULL),
	(293, 'Luminarias en módulo', 'Fuente de iluminación para los usuarios en los cuartos y sanitarios del módulo de servicios.', 'Luminario de sobreponer para lámpara fluorescente, cuerpo de acero formado, difusor de acrílico p1, acabado de pintura horneada micro pulverizada color blanco, con dos tubos fluorescentes de 32w, 4100°k, para operar a 127 vca, 60 hz . de la serie oficinas, catálogo of4008b, marca construlita o similar.', NULL),
	(294, 'Muros de Módulo', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Muro de concreto armado e= 10 cms, acabado fino y recubierto de pintura epoxica color blanco por la parte interior , aplicado a dos manos como mínimo o en las capas que sean necesarias, acabado exterior  aparente , rayado horizontalmente con buñas de 1/2" @ 10 cms y recubierto con pintura epoxica color gris con módulos de ventilación tipo louver.', NULL),
	(295, 'Losa de Modulo de Servicios ', 'Cierre superior que sirve para proteger a los usuarios en el interior del módulo de servicios, de los factores climáticos.', 'Losa de concreto armado, espesor de 12cm con armado de acero de refuerzo fy=4200 kg/cm^2  con cimbra y acabado aparente en lecho bajo, chaflan a 45° y entortado de concreto simple de 5 cm fc=100 kg/cm^2, impermeabilizante hidroprimer en toda la superficie, incluyendo el chaflán, hasta cubrir perfectamente e impermeabilizante morther-plas color aluminio para cubrir la superficie de la azotea, chaflán y hasta 15 cm de pretil, rematando en una buña perteneciente al mismo pretil.', NULL),
	(296, 'Cancel Fijo', 'Protege a los usuarios en el interior del módulo de servicios, de los factores climáticos y da seguridad.', 'De aluminio de 2" anonizado, fijo a losa, piso, así como a mocheta, desligada del perfil metálico colocando silicón en junta, con un cristal templado de 9 mm, con altura de 2.41m con un ancho que va de 2.76m a 5.52m.', NULL),
	(297, 'Muro Verde', 'ELEMENTO DECORATIVO', 'Suministro y colocación de sistema para jardín vertical (muro Verde), con paleta vegetal pre-crecida, de la familia crasulácea de acuerdo a diseño aprobado.\r\n1. Estructura perimetral de acero compuesta por PTR de 3” X 2”.\r\n2. Subestructura horizontal de acero compuesta por PTR de 2” X 1 ½”.\r\n3. Canaleta de recuperación de excedente de agua con dimensiones de 10cm frente x 10cm de base y 20cm de fondo, compuesta por lamina de acero galvanizada, compuesta por lamina galvanizada cal 10, con  protección de fibra de vidrio.\r\n4. Aislante plástico a base de polipropileno de media densidad reciclado y agregados de aluminio con un espesor de 6 mm, sujeto  la estructura con tornibrocas de acero galvanizado.   \r\n5. Dos capas de sustratos textiles de crecimiento vegetal con una densidad de 572 gr/m2, compuesto por poliéster y agregados especiales para la retención de agua y el correcto desarrollo radicular del material vegetal.\r\n6. Piezas vegetales de la familia de las crasuláceas de un tamaño mínimo de 3” de altura, suministro y colocación de lamina negra multiperforadora con perforaciones del numero 3 cal 14, con 2 capas de primer acabado en pintura electrostática color negro grafito. Pantone Inkewll SW6992 Essential 92color (marca Sherwin Williams o similar).\r\n', NULL),
	(298, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m x 0.10 m, vialeta metálica de 0.10 m x 0.11 m, vialeta plástica de 0.10 m x 0.11 m, súper vialeta de 0.20 m x 0.045 m, vialeton de 0.25 m x 0.05 m, galibo de 1.80 m x 0.06 m, botón metálico de 0.10 m de diámetro, botón metálico de 0.13 m de diámetro, boyas metálica de 0.20 m de diámetro, ', NULL),
	(299, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo Metrobús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(300, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(301, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(302, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(303, 'Dispositivo de contención peatonal', '', 'Panel electrosoldado de euroreja galvanizado de alambre cal. 9 de 2.00 mts. de alto x 2.00 mts. de largo con pintura en polvo termo endurecida color verde', NULL),
	(304, 'Bolardos de confinamiento peatonal', 'Proteger la zona peatonal,  evitando que los vehiculos accedan a las zonas de espera para cruce seguro de los usuarios. Se colocan alineados delimitando una zona en especifico. ', 'Pieza de acero cilindrica de 0.87m de alturax 0.17m de diametro con pintura negro mate y cinta reflejante de 0.10m  con grado diamante. Asentada  con mortero Cemento-arena. Y vaciado de cemento-arena.', NULL),
	(305, 'Línea de seguridad', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo basaltex color amarillo acabado estriado de 0.30mx0.30mx0.06m,hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(306, 'Piso de recinto gris', 'Material de recubrimiento en piso sobre el cual transitan los usuarios que hacen uso de la estación.', 'Loseta tipo basaltex color gris acabado liso de 0.30mx0.30mx0.06m, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', 1),
	(307, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Loseta tipo Policoncreto color amarillo direccion con barras de 0.30mx0.30mx0.06m, ahecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(308, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo Policoncreto color amarillo de 0.30mx0.30mx0.06m, de advertencia o cambio de dirección, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(309, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico .', 'Registro eléctrico de 60.0 x 80.0 cm. de ladrillo de lama de 5.5 x 11.0 x 22.0 cm, a soga, asentado y aplanado con mortero cemento - arena 1:4, con cama de grava de 5.0 cm de espeso, tapa de registro de placa de acero de 1/4" con medidas 0.55m x 0.75m, con metal desplegado c13-26 natural, punteado a la placa, para recibir las piezas del piso pegadas con resina epoxica. Piso prefabricado de concreto fc 250 kg/cm2 en piezas de 0.20m x 0.20m x 2.5 cms de espesor', NULL),
	(310, 'Estela informativa central (luminosa)', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30mx0.30. x1.00m recubierta con pintura, y saliente de anclas,placa base a la estructura de PTR De 4"X4"X1.54m y Estructura de prisma triangular de 0.50m por ladox2.14m de altura recubierta con pintura y señaletica de "nombre de estación en cada una de sus caras; copete triangular de 0.85m por lado x0.15m de espesor y luminarias en cada uno de sus lados.', NULL),
	(311, 'Estela informativa Lateral', 'Señalamiento exterior en forma vertical que indica el nombre de la estación.', 'Base de concreto armada de 0.30mx0.30. x1.00m recubierta con pintura, y saliente de anclas,placa baseala estructura de PTR De 4"X4"X1.54m y Estructura de prisma triangular de 0.50m por ladox2.14m de altura recubierta con pintura y señaletica de "nombre de estación en cada una de sus caras; copete triangular de 0.85m por lado x0.15m de espesor .', NULL),
	(312, 'Banqueta de media luna', 'Base sobre la cual se desplanta el señalamiento tipo estela. ', 'Firme de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con malla electrosoldada 6x6 10/10, preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado.', NULL),
	(313, 'Guarniciones', 'Estructura baja que tiene la función de proteger de forma perimetal, la base del señalamiento tipo estela. ', 'Elemento de concreto fc= 150 kg/cm2 hecho en obra de 10 cms de espesor, armado con varilla 3/8", preparación de la superficie, colado, tendido, nivelado, vibrado, curado, terminado apalillado, con acabado en pintura esmalte amarillo tránsito.', NULL),
	(314, 'Piso de recinto negro astriado .', 'Material de recubrimiento en piso sobre el cual transitan los usuarios que hacen uso de la estación.', 'Loseta tipo basaltex color Negro acabado astriado de 0.30mx0.30mx0.06m, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', 1),
	(315, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Loseta tipo Policoncreto color amarillo direccion con barras de 0.30mx0.30mx0.06m, ahecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(316, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo Policoncreto color amarillo de 0.30mx0.30mx0.06m, de advertencia o cambio de dirección, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(317, 'Muro deflector', 'Elemento que forma parte de la cimentación de la rampa, su estructura sólida y con  caracteristicas de contensión, protege la circulación de los usuarios.', 'Muro de concreto armado de 30 cm de espesor con acabado aparente pulido y recubierto con pintura gris, concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. ', NULL),
	(318, 'Encauzadores', 'Elemento estructural metálico que delimita y protege la circulación de los usuarios en la zona de rampa.', 'Marco conformado por viga ips de 6"x4"x1.00m En largo variable dependiendo la distacia de la rampa soldada a placa en piso en los laterales, y remate de solera superior de 4"x largo variablex 3/4" de espesar; y 9 Tubulares de 3/4" de diametro con largo entre 1.35 a 1.70 m, (cada módulo) recubierta con pintura negro mate.', NULL),
	(319, 'Barandal Pasamanos', 'Elemento estructural metálico que delimita y protege la circulación de los usuarios en la zona de rampa.', 'Barandal, sección tubular a base de perfil metalico OC de 114x6.2 mm como postes a una altura de 1.0m, placas base de 1/2"" de espesor, solera de 2""x13mm, tubos circulares OC de 21x1.3 mm horizontales @10cm de centro a centro y pasamanos doble de acero inoxidable tipo OC de 38mm de díametro. (ver diseño en planos correspondientes). primer anticorrosivo de cromato de zinc y pintura automotiva color pantone 877c.\r\n', NULL),
	(320, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Registro de concreto armado y tapa para mantenimiento de canalizacion a luminarias de poste, recubierta de piso de recinto negro antiderrapante y con jaladeras de redondo para su mantenimiento y servicio de 0.65mx0.50m', NULL),
	(321, 'Luminaria en poste', 'Fuente de iluminación para  la circulación de los usuarios que transitan en la zona de rampa para acceso o salida de la estación.', 'Lamparas con estructura tipo poste fijadas mediante pernos a piso y placa basede 0.25mx0.25m, de luz led´s y fotocelda de encendido automatico estructura tipo conica piramidal de 51/2" a 2 1/2"', NULL),
	(322, 'Piso de recinto negro liso', 'Material de recubrimiento en piso sobre el cual transitan los usuarios que hacen uso de la estación.', 'Loseta tipo basaltex color Negro acabado liso de 0.30mx0.30mx0.06m, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', 1),
	(323, 'Guía táctil', 'Pieza de señalización en piso con relieves en forma lineal, cuya textura y color de contraste indica la ruta táctil para orientación en el desplazamiento de las personas con discapacidad visual (con el apoyo de bastón), desde la zona de rampa de acceso a la estación, hasta la zona de puertas de ascenso al autobús.', 'Loseta tipo Policoncreto color amarillo direccion con barras de 0.30mx0.30mx0.06m, ahecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(324, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo Policoncreto color amarillo de 0.30mx0.30mx0.06m, de advertencia o cambio de dirección, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(325, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(326, 'Nariz de andén ', 'Borde estruc tural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(327, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Tapa registro a bajo andén con jaladeras de redondo para su mantenimiento recubierta de piso de recinto negro y placa inferior; compuesta por dos tapas independientes de 0.45mx0.90m. de estructura de angulo  recubierta de praimer base gris.', NULL),
	(328, 'Portón de acceso', 'Puerta principal para cierre de la estación cuando esta se encuentra fuera de servicio.', 'Portón de acceso compuesto por dos hojas abatibles con 2 topes limite, un cerrojo, 2 pasadores a piso, 4 casquillos en piso y 4 tejuelos. con logo de la Ciudad de México', NULL),
	(329, 'Cortinas de servicio ', 'Cortinas para cierre de estación cuando esta se encuentra fuera de servicio,  en zona de ascenso y descenso al autobús.', 'Cortina enrollable de aluminio, con tabletas planas multiperforadas de aluminio extruido anodizado calibre 16 de 8 cms de ancho con piezas laterales de diseño en pvc remachadas en los extremos de las tabletas, marco, guias, sistema de cadena, pasador, barra de acero. Primer cortina de 4.53 m de ancho por 2.50 m de alto mas rollo, segunda cortina de 2.64 m de ancho por 2.50 m de alto mas rollo y tercer cortina de 2.54 m de ancho por 2.50 m de alto mas rollo, (por sentido de circulacion); con función de cadena ubicadas en piernas de estructura y gabinete de rollo en caja de lamina con pintura negro matede 0.56 m X 0.57 m X largo respectivamente.', NULL),
	(330, 'Estructura', 'Conjunto de elementos horizontales y verticales entrelazados entre si, que de forma constructiva estan destinados a soportar la cubierta de la estación.', 'Columnas de 11" de diametro por 3.70 m de altura ubicadas por ejes de estación con viga transversal superior y lamina rolada de remate; tubo circular inferior de 6" para soportes de mampara de cristal; vigas IPS a ejes y perfiles PTR para recibir policarbonato.con pintura negro mate; piernas estructurales de 0.37 m X 0.10 m X 2.45 m soldadas a columnas para riel de cortina en purtas de servicio con puntura negro mate; base tubular en escuadra a ejes de estructura ambos sentidos para colocacion de puntas de pararayos (Faraday)  con pintura negro mate.', NULL),
	(331, 'Equipo de recaudo', 'Conjunto de equipos que tienen la función de controlar los accesos y salidas de la estación y prestar el servicio a los usuarios para la compra y recarga de las tarjetas para el ingreso y uso del servicio al interior de la estación.', 'Torniquete de entrada, torniquete de salida,  validadores, maquinas expendedoras, garita, encauzador de acero , cámaras de videovigilancia y pantallas informativas.', NULL),
	(332, 'Dispositivos para personas con discapacidad', 'Elementos de apoyo para que las personas con discapacidad el uso de la estación y del servicio.', 'tactograma de acero inoxidable con placas de 0.20x0.20 m (variable) con estructura de tubo de 2" por 0.90 m de altura de acero inoxidable y placas tope de acrilico de 0.35x0.30m fijadas con remaches a estructura; botonera de encendido de torreta fijada a pierna de 1er puerta de servicio; botonera de apagado exterior con tubo de 2" por 1.18 m y caja (para operador); torreta giratoria con luz indicadora de acseso fijada a estructura; botonera de audio de programa de corridas (1 pza por sentido general)', NULL),
	(333, 'Extintores y Gabinetes Metalicos', 'Tienen la función de apagar o controlar incendios para salvaguardar la integridad de los usuarios. ', 'Gabinete rectangular de lamina de 0.36x0.21x0.71 m fijado a estructura de estación con pintura roja y cristal transparente de 0.21x0.57 m y chapa de servicio; extintor tipo ABC de 4.5 Kg. De capacidad ubicado dentro de gabinete, Extintor tipo ABC de 4.5 Kg. De capacidad ubicado dentro de gabinete.', NULL),
	(334, 'Techumbre (cubierta de la estación)', 'Cierre superior que sirve para proteger a los usuarios en el interior de la estación, de los factores climáticos.', 'Placas de policarbonato celular de 16 mm de espesor color reflective gray de 3.35 kg./m2 para cubierta en estación fijadas a estructura en base tornilos exagonales de punta de broca, y sello de silicon. Esto asentado sobre la estructura metalica ', NULL),
	(335, 'Cubre Mamparas (cristales)', 'Elemento circular perpendicular que protege mamparas en los modulos entre ejes de estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Protección tubular de acero inoxidable con diámetro de 4" en acero inoxidable y longuitud de 600 cm,  cubremamparas ubicado entre columnas y soldado a placa de acero inoxidable y tornilleria a columnas.', NULL),
	(336, 'Registros eléctricos ', 'Apertura en forma de caja con tapa a nivel de piso, cuya función es dar acceso para mantenimiento al cableado eléctrico que alimenta las luminarias ubicadas en la rampa de la estación.', 'Registro de concreto armado y tapa para mantenimiento de canalizacion a luminarias de poste, recubierta de piso de recinto negro antiderrapante y con jaladeras de redondo para su mantenimiento y servicio de 0.65mx0.50m', NULL),
	(337, 'Mamparas de cristal', 'Elemento de cerramiento transparente perimetral de la estación, que tiene la funcion de delimitar el espacio al interior de la plataforma.', 'Modulo de mampara de cristal claro templado de 6.0+6.0 mm . de espesor en estación, con película de polivinil butiral y logotipos de la Ciudad de México y Metrobús.  Incluye: clip de sujeción, solera de 1/2" para sujeción horizontal inferior, calzas de neopreno, vinilos, selladores. de diferentes dimenciones', NULL),
	(338, 'Señalética interior y exterior (estructuras de puente)', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'señalamiento de Ruta de evacuación, letrero luminoso de nombre de estación a base de acrílico de a dos caras "nombre de estación"  Estructura en marco de tubular de 2"  con lmnarias interiores lamina de policarbonato blanco por ambos lados tipo tambor  con soporteria intermedio de 0.50m x 3.00m soldado a la estructura de la estación,calcomanía en poste  "acceso a discapacitados"  restrictivo "recomendaciones" yseñalamiento tipo puente de direcciones en distintas medidas . ', NULL),
	(339, 'Contactos Generales', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(340, 'Contacto de Emergencia', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación. Y servciones de emergencia en caso de no tener energia en dicha estación.', 'Contacto duplex polarizado con conexión a tierra1 fase 3 hilos 127 volts 1 AMPS provisto de placa de aluminio libre de cobre, con caja de chalupa galvanizada inutrial y tapa de sobre-poner deseguridad fijada con tornilleria.', NULL),
	(341, 'Gabinete de radio de comunicación', 'Caja de resguardo y recarga elécgtrica del equipo de comunicación del personal de seguridad de la estación.', 'Gabinete metálico de 0.25 m x 0.20 m x 0.15 m, tipo himel', NULL),
	(342, 'Luminarias en puerta de servicio ', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona de puertas para ascenso y descenso del autobús  (lecho bajo de la cubierta).', 'Modulo de luminaio interior en stock de 3 piezas con dimenciones de 23.7 cm x 7.6 cm x.44 cm co placa de alminio y luminarias moviles independientes de tipo led´s mdelo YDLED-12/9W/30/AL BAHIA III ', NULL),
	(343, 'Luminarias Arbotantes Centrales ', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona central a lo largo de la plataforma  (lecho bajo de la cubierta).', 'luminaria arbotante de sobreponer modelo wallpack elite de leds  de 34 w , cuerpo fundido de alumnio inyectado, esmaltado mediane proceso electrostatico con pintura acrilica en polvo termoendurecible, acabado color negro con tornilleria de seguridad; lente de policarbonato de alto impacto con protección para interperie de IP65', NULL),
	(344, 'Línea de seguridad (Botón Direccional)                        ', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo Policoncreto color amarillo de 0.30mx0.30mx0.06m, de advertencia o cambio de dirección, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(345, 'Luminarias de Candil', 'Fuente de iluminación para los usuarios en la estación, ubicadas en la parte superior de la zona central en el vestibulo de la plataforma en estaciones tipo H  (lecho bajo de la cubierta).', 'Lumiario flourecente compacta para suspender de 2x32w 120v, con difusor de acrilico balastro electronico para 2 lamparas de 32w lightolier servicio normal, conectada a un circuito con respaldo de energia.', NULL),
	(346, 'Plano de sistema, Ruta, y Barrio', 'Conjunto de señalamiento visual informativo en el interior de la estación, para facilitar el uso y estancia de los usuarios dentro  del servicio.', 'Señalamiento informativo conformado por una placa de acrilico en un marco de alumnio de 1.15 m x 0.80 m el cual se encuentra atornillado a una estructura de tubular de 2" de hacero inoxidable con placa atornillada a piso. ', 0),
	(347, 'Sistema de Tierras y Puntas Pararayos Faraday', 'Elemento eléctrico retener un sistema de descarga en un tormenta electrica y proteger a los equipos de mantenimiento y de comunicación al interior de la estación.', 'Cable desnudo  de 8 hilosque pasa atravez de la estructura desde el bajo anden hasta la techumbre .  Punta faraday macisa de acero ioxidable pulida con cuerda en un extremo marca ranicin , sujetador de laton atornillado a estructura.', NULL),
	(348, 'Piso de recinto negro  .', 'Material de recubrimiento en piso sobre el cual transitan los usuarios que hacen uso de la estación.', 'Loseta tipo basaltex color Negro acabado liso de 0.30mx0.30mx0.06m, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', 1),
