	(350, 'Pieza de puntos cambio direccional', 'Pieza de señalización en piso con relieves en forma de boton circular, cuya textura y color de contraste indica la advertencia de un cambio de trayectoria o un alto en el desplazamiento de las personas con discapacidad visual.', 'Loseta tipo Policoncreto color amarillo de 0.30mx0.30mx0.06m, de advertencia o cambio de dirección, hecha a base de concreto vibro prensado en dos capas, una denominada capa fina y la otra como capa gruesa, curado en cámara de vapor con una resistencia mínima de 250 gk/cm2, con agregado de mármol, basalto y zinc,asentada con mortero cemento- arena 1:4 adicionado con adhecon y agregado de pega azulejo ; junteada con agregado tipo juntex. ', NULL),
	(351, 'Muro deflector', 'Elemento que forma parte de la cimentación del anden de la plataforma de la estación .Su estructura sólida y con caracteristicas de contensión, protege la circulación y estancia de los usuarios. Este muro delimita y protege tambien el espacio en el bajo andén.', 'Cadena de remate de piso de rampa, de 30 cm de peralte y hasta 40 cm de ancho, de concreto fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(352, 'Nariz de andén ', 'Borde estructural sobre los muros deflectores de la plataforma, sirve de transisión y aproximación en piso para la  circulación de los usuarios entre el autobús y la plataforma de la estación, así como para la protección del espejo retrovisor del autobús. Reduce la distancia a  nivel de piso entre el interior del autobus y la plataforma.', '"Nariz" de remate de andén de concreto fc 250 kg/cm2 de 15 cms de espesor y hasta 56.5 cms de ancho, armada con acero de refuerzo fy 4200 kg/cm2. acabado pulido integral desde el colado, con llana metálica, sin espolvorear cemento.', NULL),
	(353, 'Tapa Registros de servicio a bajo andén', 'Tapa a nivel de piso de la plataforma de la estación, para el acceso a bajo andén en donde se alojan las trayectorias del cableado de instalaciones electricas y de datos de la estación. Esta tapa se retira para tener acceso al bajo anden para personal de mantenimiento.', 'Tapa registro a bajo andén con jaladeras de redondo para su mantenimiento recubierta de piso de recinto negro y placa inferior; compuesta por dos tapas independientes de 0.45mx0.90m. de estructura de angulo  recubierta de praimer base gris.', NULL),
	(354, 'Puertas en módulo de servicios', 'Puertas para cierre de los cuartos de servicio y sanitarios en el área de módulos de servicio.', 'Puerta metálica de tambor, con marco a base de solera de 101x13 mm anclada al muro con 6 varillas del # 3, contramarco de ángulo de 25x3mm, tablero de perfil or rolado en frío 38x2.8mmx2.95kg/m, lámina cal. 14 como cubierta, relleno de poliestireno. primario de pintura anticorrosiva color pantone 877-c, acabado en pintura alquidálica epóxica color 877-c y esmalte transparente para dar brillo y protección. cerradura de doble manija, doble acción con resbalón giratorio de rodillo, cierrapuertas, bisagras, louver de 20x30cm en la parte inferior y jaladera por ambos lados.', NULL),
	(355, 'Accesorios y muebles sanitarios ', 'Tienen la finalidad de dar servicio de manera accesible para los servicios sanitarios. Cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', 'W.C., combo W.C.-lavabo, mingitorio, (soporteria para discapacitados), jabonera, perchero, papelera portarollos, espejo, lavabo, tarja, de acero inoxidable y cambiador.', NULL),
	(356, 'Contactos', 'Elemento eléctrico para conectar y alimentar los equipos de mantenimiento y de comunicación al interior de la estación.', 'Contacto dúplex con doble refuerzo para una conductividad máxima y retención de clavija. Orejas removibles para una instalación al ras de la pared. Pestañas rompibles para poder dividir circuitos. Diseño superficial que permite mayor espacio para los cables, de termoplástico con tapa para caja chalupa con salida', NULL),
	(357, 'Apagadores', 'Dispositivos de encendido y apagado de las luminarias en los cuartos y sanitarios del módulo de servicio.', 'Apagador doble estándar a 120 v de voltaje y 15 amperes de corriente alterna con tapa para caja chalupa con salida', NULL),
	(358, 'Luminarias en módulo', 'Fuente de iluminación para los usuarios en los cuartos y sanitarios del módulo de servicios.', 'Luminaria tipo downlight para sobreponer cuadrada de 0.236 m por lado equipada con fuente de luz LED, con cuerpo de aluminio de una aleación especialmente formulada para resistir la corrosión y una pantalla difusora de luz que reduce el deslumbramiento de la fuente luminosa y proporciona una distribución simétrica y homogénea para luz general, driver electrónico remoto con un rango de tensión de 100-240 V~ que lo hace más resistente a las variaciones de voltaje.', NULL),
	(359, 'Muros de módulo ', 'Cerramiento estructural para delimitar y proteger los espacios en el módulo de servicios.', 'Muro de concreto armado prefabricado con acabado fino y aplicación de pintura a base de agua a dos manos.Pintura color blanco opaco, Formulado a base de resinas acrílicas, arenas de sílice, mármol y aditivos de primera calidad  de base agua que nos garantiza un producto con excelente adherencia, dureza, resistencia a la intemperie y de gran rendimiento, brindándole así, un alto y duradero contenido estético a sus acabados bajo cualquier condición climatológica.15 - 17 M2 /Cub.Fina Media 0 Media 1 Gruesa', NULL),
	(360, 'Techumbre de concreto', 'Cierre superior que sirve para proteger a los usuarios en el interior del módulo de servicios, de los factores climáticos.', 'Losa de concreto premezclado bombeable fc 250 kg/cm2, armado con acero de refuerzo fy 4200 kg/cm2 de 10 cm de espesor, manto prefabricado impermeable, marca debiten app de 4.5 mm de espesor, acabado granular rojo o equivalente en calidad, aplicado en caliente.', NULL),
	(361, 'Domos de acrilico de Ventilación', 'Elemento de acrilico y aluminio para brindar iluminacion natural y ventilacion al sanitario y cuarto de limpieza.', 'Domo de 1.00x1.00m tipo burbuja de acrílico normal, de 3mm de espesor, color transparente, armado con ángulo y perfil de aluminio, fijado a marco de louver de aluminio,Marco de ventilas tipo louvers, de 0.30x1.00m c/lado, fabricadas con alumnio natural de 3" (7.62 cm) ancho y con un marco perimetral con un canal también de alumnio natural de 3" (7.62 cm) de ancho y celosía para perfiles 221 marca Cuprum o similar.', NULL),
	(362, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo 1 de 1.80 m x 0.10 m, vialeta metálica de 0.10 m x 0.11 m, vialeta plástica de 0.10 m x 0.11 m, súper vialeta de 0.20 m x 0.045 m, vialeton de 0.25 m x 0.05 m, galibo de 1.80 m x 0.06 m, botón metálico de 0.10 m de diámetro, botón metálico de 0.13 m de diámetro, boyas metálica de 0.20 m de diámetro, ', NULL),
	(363, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo Metrobús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(364, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(365, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(366, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(367, 'Muro verde- Vertical ', 'Elemento de remate confinando modulo de servicios brindando una fachada verde vertical ', 'Suministro y colocación de sistema para  jardín vertical (muro verde) con paleta vegetal pre-crecida de la familia crasulácea de acuerdo a diseño aprobado.\r\n1) Estructura perimetral de acero compuesta por PTR 3´ x 2\r\n2) Subestructura horizontal de acero compuesta por PTR 2´ x 1 1/2\r\n3) Canaleta de recuperación de excedente de agua con dimensiones: 10 cm frente x 10 cm base x 20 cm fondo, compuesta por lámina de acero galvanizada calibre 10 con protección de fibra de vidrio.\r\n4) Aislante plástico a base de polipropileno de media densidad reciclado y agregados de aluminio con un espesor de 6 mm, sujetado a la estructura y subestructura con tornibrocas de acero galvanizado.\r\n5) Dos capas de sustratos textiles de crecimiento vegetal con una densidad de 572 gr/m2, compuesto por poliéster y agregados especiales para la retención de agua y el correcto desarrollo radicular del material vegetal.\r\n6) Piezas vegetales de la familia de las crasuláceas de un tamaño mínimo de 3\' de altura.Sumunistro y colocación de lámina negra multiperforadora con perforaciones número 3 de calibre 14, con dos capas de primer, acabado de pintura electrostática color negro grafito Pantone Inkwell SW6992 Essential 92.', NULL),
