	(409, 'Tapa de registro para Sistema de Tierras de Lámina Ø = 20 cm.', 'Colocada a nivel de piso, sobre la cual transitan los usuarios que hacen uso del módulo de servicios y da acceso al registro del sistema de tierras para su mantenimiento correspondiente.', 'Fijada con tornillos tipo pija del No. 8 x 3/4".', NULL),
	(410, 'Tapa de registro para Sótano de instalaciones de 1.30 x 1.30 M.', 'Estructura metálica sobre la cual transitan los usuarios que hacen uso del módulo de servicios y da acceso al zotano de instalaciones hidro-sanitarias para su mantenimiento correspondiente.', 'Bastidor de ángulo de 3/16" x 1", cubierto con lámina antiderrapante Cal. 16. pintura de esmalte negro.', NULL),
	(411, 'Coladera de piso, aluminio Ø = 12 cm.', 'Colocada a nivel de piso, sobre la cual transitan los usuarios que hacen uso del módulo de servicios, capta los exedentes de agua producto de la limpieza.', 'Fijada con tornillos tipo pija del No. 6 x 1/2".', 0),
	(412, 'Tapón registro, bronce Ø = 10 cm.', 'Colocada a nivel de piso, sobre la cual transitan los usuarios que hacen uso del módulo de servicios, permite registrar la tubería sanitária para su mantenimiento correspondiente.', 'Roscada a Tubo de registro.', NULL),
	(413, 'Muros', 'Delimitan, protejen y dividen los espacios del módulo de servicios.', 'Block de concreto hueco de 14x20x40 cm. asentado con mortero cemento arena 1:5, acabado aplanado fino con pintura vinílica blanca en interiores y esmalte gris en exteriores.', NULL),
	(414, 'Losas', 'Cobren y protejen los espacios del módulo de servicios de los factores climáticos.', 'Concreto armado, acabado aplanado pulido con pintura vinílica blanca sobre plafones, impermeablilizante tipo "SBS" de 4.5 mm. aplicado en caliente, acabado en gravilla color rojo.', NULL),
	(415, 'Puerta metálica de 0.95 y 1.20 x 2.15 M.', 'Delimita y asegura los accesos a los espacios del módulo de servicios.', 'Marco perimetral y bastidor de PTR 2" x 3", tapas de lámina Cal. 16, louver inferior de 20x30 cm. de lámina Cal. 16 de 2" de ancho y 5 cm. de separación, bisagras tipo barril de 5/8", jaladeras de ángulo 1/4" x 2", pintura de esmalte color negro mate y cerradura doble manija de aluminio anodizado negro.', NULL),
	(416, 'Ventila tipo louver de 1.00 x 0.50 M.', 'Ventila y asegura los accesos a los espacios del módulo de servicios.', 'Marco perimetral de PTR 2" x 3", louver de lámina Cal. 16 de 3" de ancho y 7.62 cm. de separación, pintura de esmalte negro mate.', NULL),
	(417, 'Canceleria', 'Cubre los canceles divisorios del módulo de servicios y las ventanillas del área de atención a usuarios en las Estaciones.', 'A base de perfiles de Aluminio anodizado natural de 2", con cristal templado laminado de 9 mm. de espesor, canto pulido, fijado con Vinil perimetral y Silicón.                     ', NULL),
	(418, 'Señalamiento interno', 'Conjunto de señalamiento que clasifica los espacios del módulo de sevicios.', 'Informativo - tipo Cartel de 20 x 20 cm. (Sanitario mixto), Restrictivo - tipo Cartel de 20 x 40 cm. (NO PASE, Solo Personal Autorizado), de Estireno Cal. 15, adherido a puertas e Informativo - tipo Placa de 20 x 20 cm.               Tactograma (Sanitario Familiar) de Aluminio 8 mm. con texto y pictogramas en relieve, fijado a puertas.', NULL),
	(419, 'Muebles y accesorios sanitarios ', 'Son parte de los servicios sanitarios y cuentan con elementos de accesibilidad para el uso de las personas con discapacidad.', 'Taza, Mingitorio seco, Ovalín, Tarja, Combo sanitario (Taza y Lavabo), Barras rectas de apoyo para Discapacitados, Cambiador de pañales, Despachadores de papel, toallas y jabón de Acero inoxidable antivandalismo, Espejo con marco de Aluminio.', NULL),
	(420, 'Luminarias', 'Iluminan los espacios del módulo de servicios.', 'Lámpara de Leds tipo tubo 1 y 2 x 18 W. Gabinete de policarbonato, fijado al plafón, Apagador sencillo, con placa y accesorios de material termoplástico, color blanco.', NULL),
	(421, 'Contactos', 'Tomas de corriente para los equipos de mantenimiento y comunicación de la Estación.', ' Dobles con placas y accesorios de material termoplástico, color blanco.', NULL),
	(422, 'Elementos de confinamiento', 'Tiene la función de señalizar y delimitar de manera segura la circulación de los autobuses del sistema, segregándola de la circulación de vehículos en los carriles adyacentes.', 'Tipo "IV R" de 0.51 m x 0.16 M. y botón metálico de 0.10 m de diámetro. ', NULL),
	(423, 'Señalamiento horizontal', 'Conjunto de señales sobre el pavimento, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento de uso exclusivo para la circulación de los autobuses de Metrobús, delimitación de carriles, sentidos de circulación, seguridad de pasos peatonales, entre otros.', 'Marimbas, sargentos, solo bús, línea de acompañamiento y líneas de alto a base de pintura termoplástica blanca para demarcación vial bajo las Normas Internacionales AASHTO, retroreflectividad 300 mcd/m2 lux y resistencia al impacto de 10 libras x pulgada con microesfera.', NULL),
	(424, 'Señalamiento vertical', 'Conjunto de señales instaladas sobre postes o elementos estructurales altos, con la función de indicar de forma clara,  sobre el uso adecuado y seguro de la vialidad, indicando ordenamiento en el uso de la vialidad, a través de contenido preventivo, restrictivo e informativo.', 'Limite de velocidad, solo Metrobús, cruce peatonal, cruce de discapacitados, gálibos de altura y semáforos, señalamiento bajo ptr tubular de 2" galvanizado con lámina de señalamiento de 60 x 60 cm con esquina redondeada y adicionales de 60 x 30 ms atornilladas a apostes con tornillería de cabeza de bote, según manual de dispositivos para el control de tránsito en áreas urbanas y sub urbanas de la SEMOVI.', NULL),
	(425, 'Carpeta asfáltica', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de pavimento flexible apoyada sobre una capa de material escarificado y recompactado existente a una profundidad aproximada de 0.15 m, sub base de 0.23 m de espesor, seguida de una capa de base hidráulica de 0.17 m reforzada con el Sistema De Alta Resistencia, una base asfáltica de 0.18 m y carpeta asfáltica de alto desempeño grado PG-64-22 de 0.10 m de espesor y como superficie de rodamiento una carpeta tipo SMA de 0.04 m de espesor compactado al 90%. Las medidas así como el procedimiento constructivo, puede variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(426, 'Losa de concreto hidráulico MR-45', 'Pavimento para rodamiento de los autobuses de Metrobús, ', 'Losa de concreto hidráulico de 30 ms de espesor, apoyada  sobre capa sub - rasante existente escarificada, recompactada en una profundidad promedio de 15 ms de espesor, una capa sub- base  con relleno fluido de 20 ms de espesor y base de concreto hidráulico conformado por juntas transversales con barra pasajunta redondo liso del No. 10 de 45 ms de longitud @ 30 ms, para formar elementos rectangulares y longitudinalmente se colocarán barras de amarre varilla corrugada de 5/8" de 40 ms de longitud @30 cms.. Las medidas así como el procedimiento constructivo, pueden variar de acuerdo a los resultados de la mecánica de suelos del sitio a colocar.', 1),
	(427, 'Losa techo', 'Cierre superior que sirve para proteger a los usuarios en el interior del módulo de servicios, de los factores climáticos.', 'Losa de concreto armado espesor de 10 cm. y muros de concreto armado espesor de 15 cm. con resistencia de F’c= 250 kg/cm². Con aplanado de mezcla acabado fino y aplicación en el interior de pintura vinílica.', NULL),
	(428, 'testConcepto', 'testFunc', 'testEspec', NULL),
